(406, 12, 49, 1, 2, NULL, NULL, 'multiple', 'Pada hakikatnya norma hukum yang berlaku dalam masyarakat berfungsi untuk ....', '#####Membentuk negara hukum', '#####Meningkatkan kesadaran hukum', '#####Menciptakan ketertiban', '#####Melindungi penegak hukum', '#####Membuat kerusakan', 'C', '2024-05-22 12:36:26', 31, 22),
(407, 12, 49, 1, 2, NULL, NULL, 'multiple', 'Burung garuda adalah lambang negara Indonesia yang patut kita junjung tinggi, adapun setiap detail gambar atau simbol memiliki makna tertentu, makna bulan kemerdekaan indonesia pada lambang burung garuda terdapat didalam...', '#####sayap burung garuda', '#####ekor burung garuda', '#####pita burung garuda', '#####temeng burung garuda', '#####kepala burung garuda', 'B', '2024-05-22 12:36:26', 33, 20),
