(409, 12, 49, 1, 2, NULL, NULL, 'multiple', 'didalam peraturan kerja terdapat beberapa perintah atau larangan, yaaitu dengan tujuan...', '#####mendisiplinkan para pekerja', '#####mengekang para pekerja', '#####membantu para pekerja', '#####meringankan beban pekerjaan', '#####memberatkan beban pekerjaan', 'A', '2024-05-22 12:36:26', 50, 3),
(410, 12, 49, 1, 2, NULL, NULL, 'multiple', 'peraturan pekerjaan berisi perintah, yang apabila seorang pekerja melanggar akan mendapatkan sangsi, sangsi pertama dalam sebuah peraturan adalah...', '#####teguran', '#####denda', '#####sanksi administrasi', '#####dipindahkan yempat kerja', '#####dikeluarkan dari tempat kerja', 'A', '2024-05-22 12:36:26', 49, 4),
(411, 12, 49, 1, 2, NULL, NULL, 'multiple', 'Berikut ini yang termasuk perilaku dalam mencerminkan etos kerja yang tinggi, kecuali ....', '#####Bekerja dengan niat yang ikhlas', '#####Bekerja sesuai rencana', '#####Memiliki tujuan dan target yang jelas', '#####Bekerja saat di perlukan', '#####disiplin saat bekerja', 'D', '2024-05-22 12:36:26', 39, 14),
(412, 12, 49, 1, 2, NULL, NULL, 'multiple', 'Gaji bagi seorang pekerja adalah merupakan sebuah...', '#####kewajiban', '#####hak', '#####halangan', '#####musibah', '#####bonus', 'B', '2024-05-22 12:36:26', 42, 11),
(413, 12, 49, 1, 2, NULL, NULL, 'multiple', 'bekerja sesuai dengan job atau peraturan adalah suatu sikap yang mencerminkan...', '#####kedisiplinan', '#####keuletan', '#####keteladanan', '#####kelemahan', '#####kekuatan', 'A', '2024-05-22 12:36:26', 45, 8),
(414, 12, 49, 1, 2, NULL, NULL, 'multiple', 'candi borobudur merupakan warisan leluhur dan merupakan keajaiban dunia, candi borobudur adalah candi dari agama...', '#####budha', '#####hindu', '#####islam', '#####kristiani', '#####konghuchu', 'A', '2024-05-22 12:36:26', 50, 3),
(415, 12, 49, 1, 2, NULL, NULL, 'multiple', 'jogja adaalaah daerah yang kental denga  budaya, julukan apakaah yang disematkan pada daerah istimewa yogyakarta', '#####kota swasembada', '#####kota santri', '#####kota pelajar', '#####kota industri', '#####ibu kota negara', 'C', '2024-05-22 12:36:26', 32, 21),
(416, 12, 49, 1, 2, NULL, NULL, 'multiple', 'ibukota provinsi jawatengah terletah di Semarang, apakah nama makanan khas kota tersebut...', '#####soto', '#####pecel', '#####bakpia', '#####wingko babat', '#####gudeg', 'D', '2024-05-22 12:36:26', 48, 5),
(417, 12, 49, 1, 2, NULL, NULL, 'multiple', 'wakil presiden negara indonesia merupakan sosok ulama besar, siapakah nama beliau..', '#####amien rais', '#####buya hamka', '#####jusuf kalla', '#####ma’ruf amin', '#####boediono', 'D', '2024-05-22 12:36:26', 49, 4),
(418, 12, 49, 1, 2, NULL, NULL, 'multiple', 'hampir semua darah memiliki makanan khas masing masing, apakah makanan khas dari darah Pemalang...', '#####soto babat', '#####pindang tetel', '#####grombyang', '#####sate ayam', '#####gudeg', 'C', '2024-05-22 12:36:26', 46, 7),
(419, 12, 47, 3, 2, NULL, NULL, 'multiple', 'Faktor budaya merupakan salah satu  faktor penyebab permasalahan keberagaman sosial budaya, contohnya ….', '#####tingginya pendapatan dibandingkan pengeluaran anggota masyarakat', '#####fasilitas kesehatan, kondisi ekonomi dan pendidikan yang tidak mencukupi', '#####adanya kemajuan teknologi dan masuknya budaya asing  yang tidak sesuai', '#####kondisi biologis/fisik masyarakat  yang mudah terjangkit penyakit, kurang gizi dan sebagainya', '#####semua jawaban benar', 'C', '2024-05-22 12:38:32', 50, 40),
(420, 12, 47, 3, 2, NULL, NULL, 'multiple', 'Adanya Keberagaman sosial budaya masyarakat Indonesia memerlukan adanya harmonisasi atau keselarasan dan keserasian dalam masyarakat, untuk itu masyarakat harus mempunyai sikap toleransi, Sikap toleransi merupakan sikap ….', '#####menghormati orang lain yang mempunyai keyakinan yang berbeda dengan kita', '#####cinta bangsa dan negara di atas segalanya', '#####mementingkan kepentingan pribadi di atas kepentingan golongan', '#####mengagung-agungkan bangsa sendiri dengan merendahkan bangsa lain', '#####semua jawaban benar', 'A', '2024-05-22 12:38:32', 84, 6),
