(611, 22, 37, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">Gatekna wacan cerkak ing ngisor iki!<br />\r\nTinimbang ana omah mung nganggur lan ngenteni ditakonake anake wong, karuwan lunga nggolek pengalaman nggolek upa aneng kutha, ucape Kinanthi nalika ngajak Tangguh mangkat Semarang. Pranyata Tangguh uga sarujuk. Lan saiki wis genep setaun anggone bebarengan sinau nyambung nyawa ing kutha atlas. &ldquo;Mbak, nyuwun kentang goreng kalih es lemon tea malih, inggih.&rdquo; &ldquo;Inggih, Mbak,&rdquo; pelayan mau mesem. Tangguh nyawang kancane. Dheweke ngerteni menawa Kinanthi lagi nandang susah ing batin mlayune kudu mangan enak lan akeh. Dheweke gumun, kenangapa kancane sinarawedhi iku ora bisa mbukak atine kanggo nrima tresnane wong lanang. Kamangka wis akeh banged priya sing nyedhaki lan karep ngrengkuh Kinanthi. &ldquo;Kenangapa ta, Kin, apa ta, kurange Mas Sudibya? Priyantune nggantheng, nyambut gawene wis mapan. Superviser ing kantormu, ta?&rdquo; pitakone Tangguh. &ldquo;Piye ya, Ngguh, Mas Sudibya ora tipeku, kurang cocog, tur meneh, aku durung kepingin sinau katresnan. Esih akeh cita-cita lan kepinginan sing pingin takranggeh,&rdquo; sinambi dolanan sedhotan ing lambene, Kinanthi nyauri.<br />\r\nSaka&nbsp;cerita&nbsp;kasebut,&nbsp;Kinanthi&nbsp;nduweni&nbsp;sipat&hellip;.</p>\r\n', '#####<p>Sabar</p>\r\n', '#####<p>Pangerten</p>\r\n', '#####<p>Kemayu</p>\r\n', '#####<p>Teteg</p>\r\n', '#####<p>Gumedhe</p>\r\n', 'D', '2024-05-27 22:58:53', 12, 40),
(612, 22, 37, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">Gatekake&nbsp;pethilan&nbsp;cerkak&nbsp;ing&nbsp;ngisor&nbsp;iki!<br />\r\nKaton&nbsp;saya&nbsp;suwe&nbsp;srengenge&nbsp;saya&nbsp;mlaku&nbsp;mulih&nbsp;nyang&nbsp;parane.&nbsp;Sumiyati&nbsp;isih&nbsp;wae&nbsp;lungguh&nbsp;karo&nbsp;ngelap&nbsp;eluhe.&nbsp;Disawang&nbsp;foto&nbsp;ibune&nbsp;kang&nbsp;ana&nbsp;ing&nbsp;tangane.&nbsp;Dheweke&nbsp;isih&nbsp;lungguh ana ngisor&nbsp;wit&nbsp;randhu, ora nglegewa&nbsp;yen&nbsp;Winarto wis&nbsp;ana&nbsp;ing&nbsp;mburine.<br />\r\nSaka&nbsp;pethilan&nbsp;cerita&nbsp;cekak&nbsp;ing&nbsp;ndhuwur, pesen kang&nbsp;kakandhut&nbsp;yaiku &hellip;.</p>\r\n', '#####<p>Sumiyati&nbsp;putra&nbsp;kang&nbsp;bekti&nbsp;marang&nbsp;ibune</p>\r\n', '#####<p>Sumiyati&nbsp;mung&nbsp;predhuli&nbsp;marang&nbsp;Winarto</p>\r\n', '#####<p>Sumiyati&nbsp;putra&nbsp;kang&nbsp;bhekti&nbsp;marang&nbsp;ibune</p>\r\n', '#####<p>Winarto&nbsp;seneng&nbsp;ndelik ngamati&nbsp;Sumiyati</p>\r\n', '#####<p>Darmo lan sumiyati</p>\r\n', 'A', '2024-05-27 22:32:56', 22, 30),
