(708, 14, 33, 1, 2, NULL, NULL, 'multiple', 'Kebijakan pengaturan dan perlindungan tentang hak cipta di Indonesia telah diatur dan ditetapkan dalam peraturan….', '#####UU Nomor 12 Tahun 1997', '#####UU Nomor 14 Tahun 2001', '#####UU Nomor 19 Tahun 2002', '#####UU Nomor 28 Tahun 2014', '#####UU Nomor 13 Tahun 2016', 'C', '2024-05-25 15:35:39', 30, 22),
(709, 14, 33, 1, 2, NULL, NULL, 'multiple', 'Paten adalah hak eksklusif yang diberikan oleh negara kepada inventor atas hasil invensinya di bidang teknologi untuk jangka waktu tertentu melaksanakan sendiri invensi tersebut atau memberikan persetujuan kepada pihak lain untuk melaksanakannya. Hal tersebut telah dituliskan dan diatur dalam peraturan…….', '#####UU Nomor 12 Tahun 1997', '#####UU Nomor 14 Tahun 2001', '#####UU Nomor 19 Tahun 2002 ', '#####UU Nomor 13 Tahun 2016', '#####UU Nomor 28 Tahun 2014', 'B', '2024-05-25 15:35:39', 26, 26),
(710, 14, 33, 1, 2, NULL, NULL, 'multiple', 'Ketika Anda telah mendaftarkan hak cipta atas karya intelektual yang dibuat, Anda memiliki hak moral dalam ciptaan tersebut. Di antara pilihan berikut, yang tidak termasuk dalam hak moral yang dijamin undang-undang adalah…….', '#####Mengubah judul dan anak judul ciptaan.', '#####Menggunakan nama aliasnya atau samarannya.', '#####Tidak diizinkan mengubah ciptaannya sesuai dengan kepatutan dalam masyarakat.', '#####Tetap mencantumkan atau tidak mencantumkan namanya pada salinan sehubungan dengan pemakaian ciptaannya untuk umum.', '#####Mempertahankan haknya dalam hal terjadi distorsi ciptaan, mutilasi ciptaan, modifikasi ciptaan, atau hal yang bersifat merugikan kehormatan diri atau reputasinya.', 'E', '2024-05-25 15:35:39', 9, 43),
(711, 14, 33, 1, 2, NULL, NULL, 'multiple', 'Pengaturan dan perlindungan tentang hak cipta telah menjelaskan hak moral serta hak ekonomi yang dapat diberikan pada si pemilik hak cipta. Berikut adalah beberapa contoh hak ekonomi yang tercantum dalam UU Nomor 28 Tahun 2014. (1) Penerbitan ciptaan (2) Penggandaan ciptaan dalam segala bentuknya (3) Pengubahan ciptaan (4) Penyewaan dan alih fungsi ciptaan (5) Pendistribusian ciptaan atau salinannya. Dari aspek hak ekonomi tersebut, ketentuan yang paling sesuai dengan peraturan perundang-undangan adalah…..', '#####(1)-(2)-(4)', '#####(1)-(2)-(5)', '#####(2)-(3)-(4)', '#####(1)-(2)-(4)-(5)', '#####(1)-(2)-(3)-(4)-(5)', 'E', '2024-05-25 15:35:39', 8, 44),
(712, 14, 33, 1, 2, NULL, NULL, 'multiple', 'onsep yang dapat digunakan untuk memberikan pengetahuan mengenai penggunaan teknologi          dunia maya dengan baik dan benar adalah pengertian dari...', '#####Warga digital', '#####Kewargaan digital', '#####Rakyat digital', '#####Masyarakat digital', '#####Kemasyarakatan digital', 'B', '2024-05-25 15:35:39', 31, 21),
