(582, 22, 37, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">Raden Werkudara lair awujud bungkusan, kang ora bisa disuwek nganggo gaman apa wae. Prabu pandhu mbuwang bayi bungkus ana alas Mandalasara, suwene wolung taun bungkus ora pecah-pecah lan glundhang-glundhung mrana-mrene nganti alas dadi rata. Kejaba iku para Jin alas Mandalasara uga rumangsa keganggu saengga batari Durga ngadep marang Batara Guru rajane para dewa. Batara Guru banjur dhawuh marang Batara Banyu, Batari Durga, Gajah Sena kanggo mudhun ing alas Mandalasara saprelu mecah bayi kang awujud bungkusan iku.<br />\r\nNalika pecah, Batari Durga mlebu ana ing bungkus menehi klambi, poleng Bang Bintulu, Gelang candrakirana, kalung Nagabanda. Giliran Gajah Sena mecah bungkus, Gajah Sena nabrak nyruduk nganggo gadinge nanging bayi malah nglawan, metu saka bungkuse Gajah Sena ditendang langsung mati.<br />\r\nBima duwe sedulur tunggal Bayu yaiku, Anoman, gunung Maenaka, Garuda Mahambira, Ular Naga Kurawa, Gajah setubanda, kapiwara, yeksendra yayahwreka. Bima awake gagah prakasa watake wani, tegas, teguh iman. Bima meguru marang resi Durna bab olah batin lan keprajuritan.<br />\r\nManut begawan Abiyasa, Bima dibuwang ana ing....</p>\r\n', '#####<p>Alas Roban</p>\r\n', '#####<p>Alas Mandalasara</p>\r\n', '#####<p>Alas Madalasara</p>\r\n', '#####<p>Indrakila</p>\r\n', '#####<p>Kurusetra</p>\r\n', 'B', '2024-05-27 23:01:57', 45, 7),
