(588, 22, 37, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">1. Asalamualaikum, nuwun.<br />\r\n2.&nbsp;Para pepundhen, para sesepuh, para pinisepuh ingkang kinabekten. Bapak Ibu, para rawuh ingkang dhahat kinurmatan.<br />\r\n3.&nbsp;Langkung rumiyin, mangga kula dherekaken muji syukur dhumateng ngarsanipun Gusti Allah ingkang sampun paring kanugrahan ingkang arupi kesehatan. Saengga ngantos wekdal menika panjenengan saged ngrawuhi adicara tasyakuran penganten menika.</p>\r\n\r\n<p style=\"text-align: justify;\">4. Para rawuh ingkang kinabekten, salajengipun keparenga kula ngaturaken reroncening adicara ingkang sampun rinacik, dening para kadang kaluwarga, ingih menika:.........................<br />\r\nPerangan teks panatacara iki wis cocog karo nomerekajaba....</p>\r\n', '#####<p>Nomer 1 salam pambuka</p>\r\n', '#####<p>Nomer 2 atur pakurmatan</p>\r\n', '#####<p>Nomer 3 atur puji syukur</p>\r\n', '#####<p>Nomer 4 surasaning adicara</p>\r\n', '#####<p>Nomer 4 wusananing adicara</p>\r\n', 'E', '2024-05-27 22:57:16', 13, 39),
