(591, 22, 37, 1, 2, NULL, NULL, 'multiple', 'Para pepundhen,para sesepuh, pinisepuh ingkang kinabekten. Bapak-bapak , ibu-ibu, para rawuh putra – putri ingkang dhahat kinurmatan. Tembung putra-putri ana ing prathelan ing dhuwur diarani tembung....', '#####Sanepa', '#####Saloka', '#####Pepindhan', '#####Rura basa', '#####Yogyaswara', 'E', '2024-05-24 11:02:58', 3, 49),
(592, 22, 37, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\"><strong>Pandhu Jumeneng Nata Ing Hastinapura</strong><br />\r\nNegara Hastinapura kagungan putra calon gumanti nata, yaiku kang pambarep Dhestarastra, Panengahe Pandhu Dhewanata, lan mbontote Widura. Dhestarastra, Pandhu Dhewanata, lan Widura digulawentah dening Resi Bisma. Katelune iku kang bakal mbacutake keprabone dharah kuru.Dhestarastra duwe kaluwihan prigel olah jaya kawijayan. Pandhu prigel babagan olah kridhaning jemparing, dene Widura prigel babagan weliding pedang lan sanjata.<br />\r\nNanging kang jumeneng nata ing Hastina iku Pandhu, jalaran Dhestarastra cacat netra, dene widura duwe cacat sukune dawa sesisih.Saka sarasehan agung netepake kang dijenengake nata Pandhu. Dhestarastra lila yen sing kawisudha dadi ratu iku Pandhu, amarga dheweke nglenggana duwe kekurangan kang ginaris dening Gusti Kang Murbeng Jagad. Miturut pamanggihe, Negara kang dipangarsani titah kang cacat bakal nuwuhaken swasana kang ora becik./Latar saka crita wayang ing dhuwur yaiku&hellip;.</p>\r\n', '#####<p>Mandakara</p>\r\n', '#####<p>Gandara</p>\r\n', '#####<p>Suwala</p>\r\n', '#####<p>Dewaka</p>\r\n', '#####<p>Hastinapura</p>\r\n', 'E', '2024-05-27 22:52:50', 35, 17),
(593, 22, 37, 1, 2, NULL, NULL, 'multiple', 'Sing dadi ratu biasane putra pambarep. Nanging Dhestarastra ora gelem dadi ratu amarga ngrumangsa kekurangane. Pitutur kang bisa kajupuk saka crita kasebut yaiku....', '#####Aja rebutan panguwasa', '#####Nglenggana marang kekurangane', '#####Negara kang adiluhung', '#####Ngalah dhuwur wekasane', '#####Nandur bakal ngundhuh', 'B', '2024-05-24 11:02:58', 36, 16),
