(786, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this step:\na. On your android phone or tablet, open the Gmail app\nb. In the bottom right, tap compose\nc. In the “To” field, add recipient. You can also add recipient: In the “Cc” and “ Bcc” fields. ...\nd. Add a subject\ne. Write your message\nf. At the top of the page, tap Send\n\nThe text shows us how to . . .\n', '#####Use a mobile phone', '#####Write text on Gmail', '#####Send an email', '#####Make a Gmail account', '#####Send message use a mobile phone', 'C', '2024-05-25 15:43:21', 12, 19),
(787, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Tips for Success on the Telephone\nGood manners are the key to success on the telephone. Here are a few suggestions.\n Speak slowly and pronounce your words clearly. You want the other person understand you.\n Speak with a smile. People like to hear a pleasant voice.\n Always identify yourself right away. For example, , “Hello, this is Annisa. May I speak to Jennifer Quirk, please?” \n Be sure to leave a complete message. You can say, “Please ask Ms. Quirk to give me a call about the meeting tomorrow” \n Finally, always thank the person you speak with. After all, he or she took the time to talk to you. Be sure to use the person’s name if you know it. Say, “Thank you very much for your help, Ms. Quirk” .  What is the text about? .................\n', '#####The steps to use telephone. \n', '#####The ways to speak slowly.', '#####The ways to take message. ', '#####The manner to do handling telephone.', '#####The manner and tips for success to speak slowly', 'D', '2024-05-25 15:43:21', 10, 21),
(788, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to  this step:\na. To print a file, click File menu and select Print.\nb. Make sure that you have your printer installed\nc. Choose your printer and specify the required settings before clicking OK. \nd. Select Print to start printing your file.  \ne. Your file will be printed in a few moments.\n\nWhat will happen if you click the Print button?\n', '#####The printer setting window will appear.\n\n\n\n', '#####The On-screen Manual will be installed', '#####The process of printing will start.', '#####The process will be finished.', '#####The process is pending.', 'C', '2024-05-25 15:43:21', 15, 16),
(789, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>. Pay attention to this text: Step-by-Step Guide to Reconditioning a Battery .... Create a cleaning solution . Use a 2-to-1 ratio of baking soda to water to create a runny paste. This mixture will serve as a battery cleaner as well as an acid spill cover-up. Clean the battery. If the battery terminals are corroded, apply the cleaning paste (or a dedicated battery cleaning product) to the posts and scrub the build-up off with a toothbrush. A foaming reaction means the solution is working. Use steel wool for heavily-corroded batteries. Clean, wipe, and dry off the terminals completely. Verify the voltage. Connect the voltmeter. Like jumpstarting a car, the red cable connects to the positive terminal and the black cable to the negative terminal. A standard car battery contains six cells, each producing about 2.1 volts. Therefore, a healthy battery will read 12.6V. Between 10V and 12.6V will mean you can recondition the battery. At less than 10V, replace the battery instead. Empty the battery cells. Until now, you did not need to remove the vehicle\\&#39;s battery. At this point, however, you should. Have a bucket and a half-pound of baking soda nearby. Take the battery cover off and use the flathead screwdriver to remove the cell caps underneath. One by one, slowly empty the cell contents into a bucket. You can add baking soda as you go or after all the cells are empty. Either way, it will neutralize the battery acid for safe disposal at any facility, like a recycling center, that accepts hazardous waste. .... Sorce: https://www.jdpower.com/cars/shopping-guides/how-to-recondition-a-car-battery What is the function of baking soda in the phase of emptying the battery?</p>\r\n', '#####<p>Speed up the process of recharge battery</p>\r\n', '#####<p>Neutralize the battery acid for safe disposal</p>\r\n', '#####<p>Clean the corroded battery</p>\r\n', '#####<p>Charge until the normal readings, these are about 12.42V</p>\r\n', '#####<p>To remove the vehicle\\&#39;s battery</p>\r\n', 'B', '2024-06-05 11:32:49', 10, 21),
(790, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to  this text: \na. Set the Reading to Fahrenheit or Celsius. You can move the toggle switch easily to change your measurement to Fahrenheit or Celsius.\nb. Set the Measurement Unit. Choose what kind of reading you’re doing – food, body temperature, etc.\nc. Turn on the Laser Gun. The power button turns on the gun for use.\nd. Aim the Gun. Aim the gun to the object or person. Make sure there is nothing blocking the gun and target.\ne. Get Close. Get close to the object or person – between one and two feet.\nf. Pull the Trigger. Pulling the trigger gives an instant infrared reading on the gun’s display.\n\nFrom the text above, we can conclude that the best title is ....\n', '#####How to Set the Reading to Fahrenheit or Celsius\n\n', '#####How to Use a Thermometer Gun', '#####How to Set the Measurement Unit', '#####How to Turn on the Laser Gun', '##### How to Turn off the Laser Gun', 'B', '2024-05-25 15:43:21', 11, 20),
(791, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Log in to your YouTube account. Click on the video icon at the top right hand side of the window, which can be found next to your user icon, messages, apps, and notifications.  Click ‘Upload Video.’ Then, press ‘select files to upload’ to find the video file saved on your computer. Or, you can drag and drop it into the window. An optional step is to choose the privacy settings on your video….”Click Upload Video”, the word ‘upload’ has the same meaning with ….', '#####Transfer\n', '#####Take', '#####. Copy', '#####Move', '#####Add', 'A', '2024-05-25 15:43:21', 10, 21),
(792, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: How to use soldering iron 1. Melt a little solder on the tip of the iron 2. The tip of the soldering iron should be a shiny silver color. If it is black and pitted, replace it with a new one. 3. Place the soldering iron in its stand and plug it in into electric plug. 4. Wait for the soldering iron to heat up. 5. Wipe the tip of the iron on the damp sponge. This will clean the tip. 6. Moisten a soldering sponge. The best arrangement of the text is . . .</p>\r\n', '#####<p>6-4-1-3-2-5</p>\r\n', '#####<p>1-3-2-4-2-6</p>\r\n', '#####<p>2-3-6-1-4-5</p>\r\n', '#####<p>3-4-6-5-1-2</p>\r\n', '#####<p>1-2-3-4-5-6</p>\r\n', 'D', '2024-06-05 11:54:27', 11, 20),
(793, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Ladies and Gentlemen, in case of emergency, take the life jacket which is located under your seat. Put the life jacket over your head and then fasten the jacket tapes around you&rsquo;re your waist. Do not inflate the jacket until you left the aircraft. The jacket will be automatically inflated by pulling a cord, but if not, you can blow into the chip to inflate it. A light is attached to the jacket for attracting attention. The life jacket should be removed only in case of emergency. The use of TV set, AM and FM radios and radio cassettes recorders, walkman, and any mobile phones are prohibited on board as they interfere the communication and navigational system. We wish you an enjoyable flight. Where is the life jacket located?</p>\r\n', '#####<p>Over the head</p>\r\n', '#####<p>Outside the aircraft</p>\r\n', '#####<p>In the back of the seat.</p>\r\n', '#####<p>Under the seat.</p>\r\n', '#####<p>Under the table</p>\r\n', 'D', '2024-06-05 11:44:29', 14, 17),
(794, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: This is few tips for managing stress. First, working out regularly is one of the best ways to relax your body and mind. Plus, exercise will improve your mood. But you have to do it often for it to pay off. So how much should you exercise every week? Work up to 2 hours and 30 minutes of moderately intense exercise like brisk walks or 75 minutes of a more vigorous exercise like swimming laps, jogging or other sports. Focus on setting fitness goals you can meet so you don&rsquo;t give up. Most of all remember that doing any exercise is better than none at all. Second, when you&rsquo;re stressed, your muscles get tense. You can help loosen them up on your own and refresh your body by stretching, enjoying a massage, taking a hot bath or shower, getting a good night&rsquo;s sleep Third, stopping and taking a few deep breaths can take the pressure off you right away. You&rsquo;ll be surprised how much better you feel once you get good at it. Just follow these steps: sit in a comfortable position with your hands in your lap and your feet on the floor. Or you can lie down; close your eyes; imagine yourself in a relaxing place. It can be on the beach, in a beautiful field of grass, or anywhere that gives you a peaceful feeling; slowly take deep breaths in and out; do this for 5 to 10 minutes at a time. ... What is the main idea of paragraph 3?</p>\r\n', '#####<p>Sit in a comfortable position with your hands.</p>\r\n', '#####<p>Stopping and taking a few deep breaths.</p>\r\n', '#####<p>exercise will improve your mood.</p>\r\n', '#####<p>Getting a good night&rsquo;s sleep</p>\r\n', '#####<p>Getting a bad night&rsquo;s sleep</p>\r\n', 'B', '2024-06-05 11:58:51', 11, 20),
(795, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: How to Record a Video Using a Smartphone There are many important events happen in our life such as your 17th birthday. And of course, you want to keep a remembrance so you could not forget it. Here are steps on how to record a video using a smartphone. Firstly, open your camera app slide to find the video menu. Next, find the best angle for your video shoot. Don\\&#39;t forget to choose portrait or landscape mode. Your smartphone orientation is important to the result. After that, tap the record button. Usually, it is red circle button and your smartphone will start recording. If you want to end the record, tap the stop button. It is rectangular red shaped button. Your video will be saved automatically to your phone storage or slot card because it depends on your setting. What is the second step to record a video using smartphone?</p>\r\n', '#####<p>Open your camera app to find the video menu</p>\r\n', '#####<p>Find the best angle for your video shoot.</p>\r\n', '#####<p>Tap the record button</p>\r\n', '#####<p>Tap the stop button</p>\r\n', '#####<p>Choose portrait or landscape mode</p>\r\n', 'B', '2024-06-05 11:30:11', 19, 12),
(796, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to  this text: \nThis is You Tube SEO Tips for your video. First, rename your video file using a target keyword. Next, insert your keyword naturally in the video title. Next, optimize your  video description. Next, tag your video with popular keywords that relate to your topic. After that, categorize your video. Next, upload a custom thumbnail image for your video’s result link. After that, use an SRT file to add subtitles and closed captions. Finally, add Cards and End Screens to increase your You Tube channel’s viewership.\n\nWhich is TRUE according to the text?\n', '#####Insert a keyword randomly in the video title. \n\n', '#####Generalize your video. ', '#####Upload a default thumbnail image for your video’s result link', '#####Attach Cards and End Screens to increase your You Tube channel’s viewership.', '#####Minimize your video description', 'D', '2024-05-25 15:43:21', 14, 17),
(797, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to  this text: \nThis will help you to save the data usage on your android smartphone.  The following are the ways to Save your internet data on Android Smartphone.\nStep 1) Avoid streaming content.\nStep 2) Restrict App background data.\nStep 3) Use the Chrome Data Saver feature for browsing.\nStep 4) Turn off Auto Update apps and switch update Wi-Fi only.\nStep 5) Use light Version of Apps.\n(Source: https://www.techmaniya.in/)\n\nOne of tips to make save our internet data is ..\n', '#####Avoid watching videos\n', '##### Do not Surfing the internet using Chrome data saver feature', '#####Update apps continuously with auto update setting.', '#####Install pro version of apps ', '#####Use light Version of Apps', 'A', '2024-05-25 15:43:21', 7, 24),
(798, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Tips for you to use when it comes to short-answer questions in the IELTS Listening Module. a. Skim and scan the questions in your booklet before you listen, then determine what situation might be required. b. Predict the type of information you should listen for (e.g. \\&quot;How far has\\&quot; indicates distance). c. Be alert for synonyms and paraphrases. There will be times when the information expressed in the question would not be expressed in the same way as those you would get to hear. d. Read instructions carefully. e. Write what you hear. The needed information is always exactly in the form that you should place in the blanks. f. Note the maximum number of words you should write. g. Check your spelling. The word &ldquo;determine&rdquo; (step a) has a similar meaning to&hellip;.</p>\r\n', '#####<p>Decide</p>\r\n', '#####<p>Find</p>\r\n', '#####<p>Know</p>\r\n', '#####<p>Judge</p>\r\n', '#####<p>Spend</p>\r\n', 'A', '2024-06-05 12:01:06', 14, 17),
(799, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: 1. Don&rsquo;t take images at face value 2. First, Develop a critical mindset. Keep your emotional response to such stories in check. 3. Finally,use your common .Check that it &ldquo;soiunds right&rdquo;. Use your common sense! 4. Check the source . check the web address for the page your reading 5. Then,Examine the evidence. a credible news story will include plenty of facts,quote from expert, survey data and official statistics. 6. Next, See who else is reporting the story. The good arrangement for &ldquo;how to spot hoax news&rdquo; is ....</p>\r\n', '#####<p>2-4-5-6-3-1</p>\r\n', '#####<p>2-4-6-5-1-3</p>\r\n', '#####<p>2-4-5-6-1-3</p>\r\n', '#####<p>2-4-5-6-3-1</p>\r\n', '#####<p>1-2-3-4-5-6</p>\r\n', 'B', '2024-06-05 11:59:11', 17, 14),
