(802, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If she practices a lot, she will win the competition. Could you find the (verb) based on the sentence above&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.</p>\r\n', '#####<p>She</p>\r\n', '#####<p>Practices and win</p>\r\n', '#####<p>Competition</p>\r\n', '#####<p>Win</p>\r\n', '#####<p>Practices</p>\r\n', 'B', '2024-06-05 11:29:09', 15, 16),
(803, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If I have enough time this evening, I ______ the match.</p>\r\n', '#####<p>Will watching</p>\r\n', '#####<p>Will watch</p>\r\n', '#####<p>Would watch</p>\r\n', '#####<p>Would saw</p>\r\n', '#####<p>Will saw</p>\r\n', 'B', '2024-06-05 11:51:00', 21, 10),
(804, 18, 43, 3, 2, NULL, NULL, 'multiple', 'If I am hungry, I will go to the canteen.\r\n The fact based on the sentence above is……………\r\n', '#####I am not hungry\r\n', '##### I am hungry', '#####I will go to the canteen', '#####I will go the canteen to eat', '#####I am not sleepy', 'A', '2024-06-05 11:33:55', 15, 16),
(805, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If it rains, I will not come to your house. The fact based on the sentence above is&hellip;&hellip;&hellip;&hellip;&hellip;</p>\r\n', '#####<p>It not rains, and I will come to your house</p>\r\n', '#####<p>It rains</p>\r\n', '#####<p>I will not come to your house</p>\r\n', '#####<p>I will come to your house because it rains</p>\r\n', '#####<p>All answer are true</p>\r\n', 'A', '2024-06-05 11:26:46', 18, 13),
(806, 18, 43, 3, 2, NULL, NULL, 'multiple', 'If I study hard, I will pass the exam.\n The similar meaning of “study” is………………..\n', '##### Learning\n      \n', '#####Examination', '#####Exercise ', '#####Practice', '#####Winner', 'A', '2024-05-25 15:43:21', 17, 14),
(807, 18, 43, 3, 2, NULL, NULL, 'multiple', 'If I drink coffee, I will stay awake tonight. \nCould you find the (Verb) based on the sentence above…………….\n', '#####Drink\n\n', '##### Drank', '#####Drunk', '##### Drink and stay awake', '#####Stay awake', 'D', '2024-05-25 15:43:21', 14, 17),
(808, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If I get a promotion, I &hellip;&hellip;&hellip;&hellip;&hellip;a car</p>\r\n', '#####<p>Would buy</p>\r\n', '#####<p>Would Buying</p>\r\n', '#####<p>Will buy</p>\r\n', '#####<p>Will buying</p>\r\n', '#####<p>Will sell</p>\r\n', 'C', '2024-06-05 11:50:22', 16, 15),
(809, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this dialogue: Hendry : Did you hear the news that Mrs. Nike angry with Dika? Kenzi : Yes, I did. It was caused by a ball, wasn&rsquo;t it? Hendry : Yes, it was. The ball was kicked and broke some glasses at the teacher&rsquo;s office. Kenzi : I saw his face. He was a dead fish at the teacher&rsquo;s office. Hendry : Yes, you&rsquo;re right. He has been punished. The word &lsquo;caused&rsquo; (in Kenzi&rsquo;s speech) has similar meaning with &hellip;</p>\r\n', '#####<p>Buy</p>\r\n', '#####<p>Kick</p>\r\n', '#####<p>Bring</p>\r\n', '#####<p>Create</p>\r\n', '#####<p>Sell</p>\r\n', 'D', '2024-06-05 11:28:20', 10, 21),
(810, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>. Pay attention to this dialogue : Zulfa : Have you been having any problems lately? Salwa : No, but the nurse at the Nur Said clinic said that I have very high blood pressure. Zulfa : Do you have a history of high blood pressure? Salwa : No, I have never been told that I have high pressure. I also have no problem in consuming any food. Zulfa : High blood pressure is called the silent killer because it hardly ever has symptoms, so it will be better for you to pay attention to your eating pattern and life style to make your body fit. Salwa : Thanks for your valuable suggestions. Based on dialogue above, the true statement of the high blood pressure is .......</p>\r\n', '#####<p>The high blood pressure is happened because of family history of them</p>\r\n', '#####<p>The high blood pressure is happened because consuming any food</p>\r\n', '#####<p>The high blood pressure is called the silent killer beacuse it hardly ever has symptoms</p>\r\n', '#####<p>The high blood pressure is called the big problem but don&rsquo;t need to eating pattern and life style</p>\r\n', '#####<p>All answer is true</p>\r\n', 'C', '2024-06-05 11:45:08', 14, 17),
(811, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this dialogue : Sonya : Oh, no. I forgot to bring my English textbook. Dara : Don&rsquo;t worry, Sonya. If you don&rsquo;t bring your textbook, Mr. Adam __________. Last week Nico didn&rsquo;t bring his textbook and Mr. Adam said that it was okay, so he lent him one. Sonya : Really? That&rsquo;s a relief! Dara : Yeah. Mr. Adam is a kind teacher.</p>\r\n', '#####<p>Will lend you one</p>\r\n', '#####<p>Would lend the book</p>\r\n', '#####<p>Would have the book one</p>\r\n', '#####<p>Will have the book for you</p>\r\n', '#####<p>Would lend you one</p>\r\n', 'A', '2024-06-05 11:41:53', 11, 20),
(812, 18, 43, 3, 2, NULL, NULL, 'multiple', 'If he ______ the book, I will borrow it in my university library.', '#####Has\n   ', '##### Hasn’t', '#####Does have', '#####Doesn’t have', '##### Have\n', 'D', '2024-05-25 15:43:21', 8, 23),
(813, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If it rains, the grass ______ wet.</p>\r\n', '#####<p>gets</p>\r\n', '#####<p>got</p>\r\n', '#####<p>Is getting</p>\r\n', '#####<p>was gotten</p>\r\n', '#####<p>All answer is true</p>\r\n', 'A', '2024-06-05 11:19:21', 12, 19),
(814, 18, 43, 3, 2, NULL, NULL, 'multiple', 'If you _______ earlier, you would reached school on time.', '#####wake up\n\n', '#####woke up', '##### woken up', '#####had woken up', '##### A nd B are true', 'B', '2024-05-25 15:43:21', 6, 25),
(815, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>If you ____ hard, you will ____ the exam.</p>\r\n', '#####<p>studied &ndash; passed</p>\r\n', '#####<p>study &ndash; passes</p>\r\n', '#####<p>study &ndash; pass</p>\r\n', '#####<p>study &ndash; passed</p>\r\n', '#####<p>studied &ndash; pass</p>\r\n', 'C', '2024-06-05 12:03:13', 17, 14),
(816, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this dialoqgue. Dani : Hi, Oscar. Why you looks so bad. Oscar : I feel bad about Henna. Dani : Why? What happened to her? Oscar : It is because she almost gets better position in this company. The opposite of &lsquo;&rsquo;bad&rsquo;&rsquo; is&hellip;&hellip;&hellip;&hellip;</p>\r\n', '#####<p>Beautiful</p>\r\n', '#####<p>Ugly</p>\r\n', '#####<p>Dirty</p>\r\n', '#####<p>Clean</p>\r\n', '#####<p>Smart</p>\r\n', 'A', '2024-06-05 11:25:15', 14, 17),
(817, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Teacher : You\\\'ll get good scores in your exam ______ in your study.\nStudent : We\\\'ll do it, ma\\\'am.\n', '#####When you don\\\'t forget\n', '#####If you are more serious', '#####If you remember me', '#####When you like the lesson', '#####If you are not serious\n', 'B', '2024-05-25 15:43:21', 21, 10),
(818, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this dialogue:\nArmand  : Hello Joe. How are You???\nJoe    : Hey Armand, Yes I am Fine\nArmand  : Are you doing job in this company Joe???\nJoe   : No. I just send my CV to this company!!!\nArmand   : What is your plan if you get the job in this company\nJoe   : If I ______ a job in this company. I ______ buy a house for my family\n\nBased on dialogue in above, please complete the italic sentence with the best word… \n', '#####Get, Will\n \n', '#####Got, Would', '#####Gotten, Would Have', '#####Get, Would Have Been', '#####Get, would', 'A', '2024-05-25 15:43:21', 19, 12),
(819, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Could you find the best \\\'\\\'imperative sentence\\\'\\\' in the text bellow…!                                          \n1. Use a minimum of four eggs per omlete\n2. Heat the oil, not too much heat, just heat it\n  3. Put just one tablespoon of water, not milk, in with the egg\n4. Mix the eggs up, just lightly beat them with a fork\n5. Pour that into the hot pan,\n6. Omlete is ready to serve.\n', '#####1,2,3,4,5,6\n\n', '#####1,2,3,4,6', '#####1,2,3,5,6', '#####1,2,3,4,5', '#####2,3,4,5,6', 'D', '2024-05-25 15:43:21', 4, 27),
(820, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this dialogue\nJohn : Boss was mad to me this morning.\nBucky : Why?\nJohn : I drop a glass of coffee in front of him. If I knew there was a glass there, I would not move that table.\nBucky : I think you neet to move carefully next time.\nJohn : Yeah. \n\nFrom the text  the opposite of “Front’’ is…….\n', '#####Center\n', '#####Back', '##### Ahead', '#####Stretch', '#####Coming\n', 'B', '2024-05-25 15:43:21', 14, 17),
(821, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this dialogue: Anne : What do you usually do on your holiday? Rose : If I stay at home, I spend time with my sister. Anne : You don&rsquo;t go anywhere? Rose : I go to the cinema if I my sister asks me. Anne : What kind of movie you watch at cinema? Rose : I always watch thriller whenever I go to cinema. Anne : It sounds exciting. Rose : It&rsquo;s not exciting if my sister suddenly wants to watch another genre. What is the opposite meaning of &lsquo;&rsquo; Spend time&rsquo;&rsquo; based on the text above&hellip;&hellip;&hellip;&hellip;&hellip;.</p>\r\n', '#####<p>Quality time</p>\r\n', '#####<p>Free time</p>\r\n', '#####<p>Busy time</p>\r\n', '#####<p>Me-time</p>\r\n', '#####<p>Relaxation time</p>\r\n', 'C', '2024-06-05 11:58:08', 6, 25),
(822, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Ir. Soekarno was born in Blitar, East Java, June 6, 1901 and died in Jakarta, June 21, 1970 at age 69 years. He is Indonesia&rsquo;s first president who served two terms from 1945 to 1966. He played an important role for the liberation of Indonesia from Dutch colonialism. He provided Pancasila concept and was proclaimed Indonesian independence along with Mohammad Hatta which occurred on August 17, 1945. There are similar meaning of &lsquo;&rsquo;liberation&rsquo;&rsquo;, except&hellip;&hellip;&hellip;&hellip;&hellip;</p>\r\n', '#####<p>Deliverance</p>\r\n', '#####<p>Emancipation</p>\r\n', '#####<p>Obligate</p>\r\n', '#####<p>Exemption</p>\r\n', '#####<p>Dispensation</p>\r\n', 'C', '2024-06-05 12:00:23', 6, 25),
(823, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>. Pay attention to this text: Ir. Soekarno was born in Blitar, East Java, June 6, 1901 and died in Jakarta, June 21, 1970 at age 69 years. He is Indonesia&rsquo;s first president who served two terms from 1945 to 1966. He played an important role for the liberation of Indonesia from Dutch colonialism. He is a digger Pancasila and was proclaimed Indonesian independence along with Mohammad Hatta which occurred on August 17, 1945 How long Ir. Soekarno served as first president Indonesia?</p>\r\n', '#####<p>Two terms from 1901 to 1970</p>\r\n', '#####<p>Two terms from 1901 to 1945</p>\r\n', '#####<p>Two terms from 1945 to 1970</p>\r\n', '#####<p>Two terms from 1945 to 1966</p>\r\n', '#####<p>Two terms from 1901 to 1945</p>\r\n', 'D', '2024-06-05 11:31:28', 18, 13),
(824, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this text:\nR.A Kartini\nOn April 21, Indonesian celebrate the Kartini Day, the woman emanciation day. Kartini is national hero with the brilliant thought. Kartini was born in 1879 April 21 in Mayong Jepara. Her father was Rama Sosroningrat a Wedana in Mayong. Her mother was M.A. Ngasirah from Teluk Awur town in Jepara. Kartini, as the little girl of a respectable family, she had friends from Dutch. Her thought about woman in his tradition compared with modern society, was written in his letter to her friend Mrs. Abendanon.\nIn november 12, 1903. she was married by Adipati Djoyo Adiningrat, the head of Rembang. He followed his husband to Rembang.\nIn September 13, 1904, she gave birth a child, Soesalit Djoyoadiningrat. Unfortunately, after bore a baby, her condition become worse. Kartini passed away on september 17, 1904 on her age of 25th.\n\nWhy did 21 April celebrate as Kartini Day?\n', '#####Kartini conceived a child on 21 April 1879.\n \n', '#####Adipati Joyodiningrat married to Kartini at that day.', '#####Kartini was born on that date.', '#####Soesalit was 25 years old on that time.', '#####Kartini was died on 21 April', 'C', '2024-05-25 15:43:21', 16, 15),
(825, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this text:\nR.A Kartini\nOn April 21, Indonesian celebrate the Kartini Day, the woman emanciation day. Kartini is national hero with the brilliant thought. Kartini was born in 1879 April 21 in Mayong Jepara. Her father was Rama Sosroningrat a Wedana in Mayong. Her mother was M.A. Ngasirah from Teluk Awur town in Jepara. Kartini, as the little girl of a respectable family, she had friends from Dutch. Her thought about woman in his tradition compared with modern society, was written in his letter to her friend Mrs. Abendanon.\nIn november 12, 1903. she was married by Adipati Djoyo Adiningrat, the head of Rembang. He followed his husband to Rembang.\nIn September 13, 1904, she gave birth a child, Soesalit Djoyoadiningrat. Unfortunately, after bore a baby, her condition become worse. Kartini passed away on september 17, 1904 on her age of 25th.\n\nWhich sentence is correct based on the text above?\n', '#####Kartini only has a son\n\n', '##### Kartini has more than a child', '#####Kartini live in Mayong untul she is dead.', '#####Kartini and her husband live until old in Rembang.', '#####Kartini only have two sons ', 'A', '2024-05-25 15:43:21', 7, 24),
(826, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Albert Einstein was born in 1879 in the German city of Ulm. He was no prodigy as infant. In fact he was so late to speak that his parents were concerned he was fool. In school, his teachers saw no special talent in him though the signs of his intelligence were there. He taught himself calculus for example, and it is said that his teachers seemed a little afraid of him because he asked questions they could not answer. His gift was no secret. At the age of 16, he asked himself whether a light wave would seem stationary if one ran with it. It may seem like a strange questions, but it shows that Einstein was digging deep to the heart of a problem. Ten years later would arise his theory of relativity. (source: https://www.grammarbank.com/albert-einstein-article.html) From the text, we know that Albert Einstein was ......</p>\r\n', '#####<p>A special kid since he was born.</p>\r\n', '#####<p>Spoiled by his teacher at school.</p>\r\n', '#####<p>Born in the 18th century.</p>\r\n', '#####<p>could not learn science.</p>\r\n', '#####<p>Born in 1879.</p>\r\n', 'E', '2024-06-05 11:52:55', 15, 16),
(827, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: .... Musk was 24 years old when he moved to California to pursue a Ph.D. in applied physics at Stanford University. With the Internet exploding and Silicon Valley booming, Musk had entrepreneurial visions dancing in his head. He left the Ph.D. program after just two days. In 1995, with $28,000 and his younger brother Kimbal at his side, Musk started Zip2, a web software company that would help newspapers develop online city guides. In 1999, Zip2 was acquired by Compaq&rsquo;s AltaVista web search engine for a whopping $340 million. Musk used his Zip2 buyout money to create X.com, which he intended to shape into the future of banking. X was merged with a company called Confinity and the resulting company came to be known as PayPal. Musk was then ousted from the company before it was bought by eBay for $1.5 billion. After PayPal slipped away, Musk helped generate funding for an electric car startup called Tesla. The word &ldquo;ousted &ldquo; from the text of fifth paragraf above means ?</p>\r\n', '#####<p>Ejected</p>\r\n', '#####<p>Accepted</p>\r\n', '#####<p>Excepted</p>\r\n', '#####<p>Dropped</p>\r\n', '#####<p>Insert</p>\r\n', 'A', '2024-06-05 11:25:53', 13, 18),
(828, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Jobs was raised by adoptive parents in Cupertino, California, located in what is now known as Silicon Valley. Though he was interested in engineering, his passions of youth varied. He dropped out of Reed College, in Portland, Oregon, took a job at Atari Corporation as a video game designer in early 1974, and saved enough money for a pilgrimage to India to experience Buddhism. Back in Silicon Valley in the autumn of 1974, Jobs reconnected with Stephen Wozniak, a former high school friend who was working for the Hewlett-Packard Company. When Wozniak told Jobs of his progress in designing his own computer logic board, Jobs suggested that they go into business together, which they did after Hewlett-Packard formally turned down Wozniak&rsquo;s design in 1976. The Apple I, as they called the logic board, was built in the Jobses&rsquo; family garage with money they obtained by selling Jobs&rsquo;s Volkswagen minibus and Wozniak&rsquo;s programmable calculator. The word &ldquo;interested&rdquo; (2nd sentence) has the same meaning with&hellip;</p>\r\n', '#####<p>Fascinated</p>\r\n', '#####<p>Amazed</p>\r\n', '#####<p>Disappointed</p>\r\n', '#####<p>Adored</p>\r\n', '#####<p>Not interested</p>\r\n', 'A', '2024-06-05 11:48:53', 15, 16),
(829, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this text:\r\nKaka was born in Brazil. From age 4 to 7, his family lived in Cuba, following his father, a civil engineer. At age 7, the family moved to the city of Sao Paulo, in the neighborhood of Morumbi, near the stadium of Sao Paulo FC. As FIFA says, \\\"Kaka fails to the Brazilian stereo type of the kid from the favela who was played the game in the street with a ball made from rags. Coming from comfortable and cultured family, Kaka kept up his studies as long as they were compatible with his profession.\\\" His talent was soon recognized. A professor called the family and suggested enrolling him in a football school. At age 8, Kaka was playing with Sao Paulo FC, where he succeeded in all categories. At age 14, Kaka used to wake up two hours early, to keep up with his studies. Kaka managed to conclude the intermediary cycle (eleven years) in Brazil, before dedicating exclusively to football. In 2006, only 24 years old, Kaka was one of the main Brazilian players in the World Cup. Despite the abundance of good players, coach Carlos Alberto Parrera already said that Kaka would start as a principle. The groups formed by Kaka, Ronaldinho, Ronaldo and Adriano was called \\\"the Magic Square\\\" by Brazilian media fans.\r\n\r\nWhat is the topic of  the text?\r\n', '#####Kaka’s family \r\n', '##### Ka ka’s partner', '#####Kaka as San Paulo FC’s player', '#####Kaka’s biography', '#####Kaka’s story', 'D', '2024-06-05 11:20:27', 7, 24);
INSERT INTO `m_soal` (`id`, `id_guru`, `id_mapel`, `id_kelas`, `bobot`, `file`, `tipe_file`, `jenis_soal`, `soal`, `opsi_a`, `opsi_b`, `opsi_c`, `opsi_d`, `opsi_e`, `jawaban`, `tgl_input`, `jml_benar`, `jml_salah`) VALUES
(830, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Henry ford was born July 30, 1863. He grew up on a farm near Dearborn, Michigan, but he disliked farm work. He liked mechanical things. At age 16, ford got a job in a machine shop in Detroit. He later worked as an engineer. In his spare time, he built engines. After years of experimenting, ford produce his first automobile this in 1896. This vehicle was powered by a gasoline motor and mounted on four bicycle wheels. Henry ford founded the ford Motor Company in 1903. Ford wanted to produced large numbers of cars at low cost. He brought out the first model T in 1908. From 1908 to 1927, 15 million model Ts were produced. Some costs as little as $260. Ford set up factories with assembly lines that could make cars fast and efficiently. As cars were being built, they moved slowly down an assembly line. Each worker along the line did one set of tasks, on car after car. Workers on the assembly line often found their work dull and tiresome. Many of them quit after a short time. To keep his workers, ford doubled the pay for his assembly line workers. But he made them work very hard. Other automobile companies ran faster to catch up with ford. They copied ford&rsquo;s successful use of the assembly line. They also started building cars that were more advanced, better looking, and more comfortable than the model T. Ford was slow to change his ways. By the 1930&rsquo;s, Ford no longer dominated the car industry. In 1941, the United States entered World War II. Ford&rsquo;s factory went from producing cars to producing bomber planes for the US Military during the war. Ford started a charity, the ford Foundation, with his son in 1936. When ford died in 1947, he left most of his money to the Ford Foundation. The Ford Foundation is still giving money to help poor countries and poor areas. How many paragraph based on the text above?</p>\r\n', '#####<p>4 paragraph</p>\r\n', '#####<p>5 paragraph</p>\r\n', '#####<p>6 paragraph</p>\r\n', '#####<p>7 paragraph</p>\r\n', '#####<p>8 paragraph</p>\r\n', 'E', '2024-06-05 11:27:40', 5, 26),
(831, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: The first son of blacksmith Gihei Honda and his wife Mika, Soichiro Honda was born on November 17, 1906, in rural Iwata-gun, Japan. In 1922 he graduated from the Futamata Senior Elementary School. Honda had little tolerance for formal education and jumped at every opportunity he had to work with his true love: motors. Throughout his life Honda never forgot the impression that was made on him when he sighted his first automobile. After leaving school Honda began his career as an apprentice (a person who works to gain experience in a trade) auto repairman for Arto Shokai in Tokyo. In 1928 he returned to his hometown as a master mechanic and soon established a branch shop for the firm in Hamamatsu, Japan. How old was Soichiro Honda when he graduated from the Futamata Senior Elementary School ?</p>\r\n', '#####<p>fifteen years old</p>\r\n', '#####<p>sixteen years old</p>\r\n', '#####<p>seventeen years old</p>\r\n', '#####<p>eighteen years old</p>\r\n', '#####<p>seventeen years old</p>\r\n', 'B', '2024-06-05 11:47:54', 16, 15),
(832, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Torakusu Yamaha (sometimes rendered as Torakasu Yamaba) was born on 20 May 1851 in Wakayama, Kii Province, the third son of Konosuke Yamaha, a low-ranking samurai of the Kishu clan, the ruling family of the Kishu Domain. Torakusu\\&#39;s father was an astronomer for the Kishu clan, gave Torakusu access to many books about astronomy. As a result, Torakusu became fascinated with machines and technology, in addition to his interests in martial arts and kendo. In his twenties, Japanese society changed rapidly with the arrival of the Meiji Restoration in 1868, and Torakusu saw many opportunities as the era brought Westernization and the introduction of new technologies to Japan. In 1871, Torakusu went to Nagasaki and started studying watchmaking under the guidance of an English engineer. After a few years of training, Torakusu became an expert in watchmaking and later became interested in medical equipment. Torakusu then moved to Osaka to study medical equipment, where he lived behind a medical equipment store. In 1886, at the age of 35, Torakusu moved to Hamamatsu to repair medical equipment as a career. However, since Hamamatsu was a small town back then, Torakusu could not make a living repairing medical equipment, so he also repaired watches and served as a rickshaw man for a hospital director. A local primary school, Jinjou Elementary School (now Hamamatsu City Motoshiro Elementary School) asked him to fix their broken organ, as the town was small and they did not have anyone who was qualified to fix one. In 1887, two months after the project started, Torakusu and his colleague produced the first Japanese-made reed organ. After receiving negative comments, Torakusu moved closer to the music department of Tokyo. To get the organ to the university, he was forced to carry it over a distance of 250 kilometres (160 mi). Yamaha died of an illness in Tokyo on 8 August 1916 at the age of 65 years. Following his death, Vice President Chiyomaru Amano took over as the CEO of Nippon Gakki. Which is true according to the text ...</p>\r\n', '#####<p>Torakusu Yamaha desn&rsquo;t have any brother.</p>\r\n', '#####<p>Torakusu Yamaha is only focus on motorcycle</p>\r\n', '#####<p>Torakusu Yamaha went to Nagasaki and started studying watchmaking</p>\r\n', '#####<p>Torakusu moved to Tokyo to repair medical equipment as a career</p>\r\n', '#####<p>Torakusu Yamaha desn&rsquo;t have any brother and sisters</p>\r\n', 'C', '2024-06-05 11:46:19', 16, 15),
(833, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Giorgio Armani, (born July 11, 1934, Piacenza, Italy), Italian fashion designer whose signature style of relaxed yet luxurious ready-to-wear and elegant, intricately beaded evening wear helped introduce ease and streamlined modernity to late 20th-century dressing. The son of a shipping manager, Armani intended to become a doctor but left medical school to pursue a career in fashion. Beginning in 1957 he worked as a buyer for the Milan department store La Rinascente. After a seven-year stint in that position, he began to pursue a career in fashion design, training in the atelier of Nino Cerruti. In 1975, with the help of his friend and business partner Sergio Galeotti, Armani launched his own label of ready-to-wear for men and women. From the text above, we know that Giorgio Armani is ....</p>\r\n', '#####<p>a shipping manager</p>\r\n', '#####<p>a doctor</p>\r\n', '#####<p>an Italian fashion designer</p>\r\n', '#####<p>a buyer for the Milan department store La Rinascente</p>\r\n', '#####<p>a nurse</p>\r\n', 'C', '2024-06-05 11:57:14', 22, 9),
(834, 18, 43, 3, 2, NULL, NULL, 'multiple', '<p>Pay attention to this text: Iwan Tirta (April 18, 1935 &ndash; July 31, 2010) was an Indonesian batik fashion designer. Tirta trained as a lawyer, but became an internationally known designer. He is credited with beginning the early revival of batik design during the 1970s and 1980s. He also became an Indonesian and Javanese cultural advocate, as well as a food consultant, later in his career. He was widely credited with the promotion of batik designs within the international fashion industry, including its magazines and fashion shows. However, despite its newfound popularity, Tirta was a critic of the recent revival of batik in the early 21st Century. He was especially critical of the embrace mass produced, printed batik over the traditional, handmade cloth, \\&quot;The problem is that the establishment still doesn\\&#39;t know the difference between printed batik and the handmade one. It is our own mistake. They say &lsquo;creative economy\\&#39;, and that\\&#39;s a contradiction. When the word economy comes into it, you reduce everything to money. What we need now are good and knowledgeable patrons.\\&quot; Iwan Tirta died on July 31, 2010 at Abdi Waluyo Hospital in Menteng, Central Jakarta, at the age of 75. He had suffered from diabetes and several strokes in the preceding years. He was buried at Karet Bivak cemetery in Jakarta near his mother\\&#39;s tomb. In phrase &ldquo;When the word economy comes into it&rdquo;, the word &ldquo;it&rdquo; refers to . . .</p>\r\n', '#####<p>Contradiction</p>\r\n', '#####<p>Creativ Economy</p>\r\n', '#####<p>Batik fashion critic</p>\r\n', '#####<p>Batik production</p>\r\n', '#####<p>Batik promotion</p>\r\n', 'D', '2024-06-05 11:23:00', 13, 18),
(835, 18, 43, 3, 2, NULL, NULL, 'multiple', 'Pay attention to this text:\r\nIwan Tirta (April 18, 1935 – July 31, 2010) was an Indonesian batik fashion designer. Tirta trained as a lawyer, but became an internationally known designer. He is credited with beginning the early revival of batik design during the 1970s and 1980s. He also became an Indonesian and Javanese cultural advocate, as well as a food consultant, later in his career. \r\nHe was widely credited with the promotion of batik designs within the international fashion industry, including its magazines and fashion shows. However, despite its newfound popularity, Tirta was a critic of the recent revival of batik in the early 21st Century. He was especially critical of the embrace mass produced, printed batik over the traditional, handmade cloth, \\\"The problem is that the establishment still doesn\\\'t know the difference between printed batik and the handmade one. It\\\'s our own mistake. They say *creative economy\\\', and that\\\'s a contradiction. When the word economy comes into it ... you reduce everything to money. What we need now are good and knowledgeable patrons.\\\"\r\nIwan Tirta died on July 31, 2010 at Abdi Waluyo Hospital in Menteng, Central Jakarta, at the age of 75. He had suffered from diabetes and several strokes in the preceding years. He was buried at Karet Bivak cemetery in Jakarta near his mother\\\'s tomb. \r\n\r\nThe word “traditional” in paragraph 2 have similar meaning with . . . \r\n', '#####Current \r\n', '#####Modern', '#####Conventional', '##### Contemporary', '#####Up to date', 'C', '2024-06-05 11:21:51', 14, 17),
