(885, 25, 36, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">Bacalah teks berikut!<br />\r\nDemi ibunya yang telah bersusah payah membiayai hidup dan pendidikannya, Habibie belajar dengan sungguh-sungguh. Tekadnya ia harus jadi orang sukses. Pada saat ia kuliah di Jerman itu, tahun 1955, di Aachean, 99% mahasiswa Indonesia yang belajar di sana diberi beasiswa penuh. Hanya beliau lah yang memiliki paspor hijau. Ketika musim liburan tiba, ia menggunakan waktunya untuk mengikuti ujian dan bekerja. Sehabis masa libur, ia kembali fokus belajar. Gaya hidupnya ini sangat berbeda dibandingkan teman-temannya yang memilih menggunakan waktu liburan musim panas untuk bekerja, mencari pengalaman, tanpa mengikuti ujian.<br />\r\nHal yang dapat diteladani dari tokoh adalah&hellip;</p>\r\n', '#####<p>Tidak patuh pada orang tua</p>\r\n', '#####<p>Tidak mengikuti ujian</p>\r\n', '#####<p>Belajar dengan sungguh-sungguh dan pekerja keras</p>\r\n', '#####<p>Menghamburkan uang dengan berfoya-foya</p>\r\n', '#####<p>Mencari pengalaman bekerja</p>\r\n', 'C', '2024-05-27 21:52:48', 56, 12),
