(901, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah puisi berikut!<br />\r\nIni kali tidak ada yang mencari cinta<br />\r\nDi antara gudang, rumah tua, pada cerita<br />\r\nTiang serta tali temali. Kapal, perahu tiada berlaut,<br />\r\nMenghembus diri dalam mempercaya mau berpaut<br />\r\nGerimis mempercepat kelam.<br />\r\nAda juga kelepak elang<br />\r\nMenyinggung muram, desir hari lari berenang<br />\r\nMenemu bujuk pangkal akanan.<br />\r\nTidak bergerak<br />\r\nDan kini tanah, air tidur, hilang ombak<br />\r\nTiada lagi.<br />\r\nAku sendiri.<br />\r\nBerjalan<br />\r\nMenyisir semenanjung, masih pengap harap<br />\r\nSekali tiba di ujung dan sekalian selamat jalan<br />\r\nDari pantai keempat, sedu penghabisan bisa terdekap<br />\r\nPesan yang disampaikan dalam puisi tersebut adalah&hellip;</p>\r\n', '#####<p>Merasa sedih dan terpuruk bukanlah hal yang salah dalam kehidupan manusia.</p>\r\n', '#####<p>Merasa sedih dan terpuruk bukanlah hal yang salah dalam kehidupan manusia.</p>\r\n', '#####<p>Tetap ikhlas akan takdir hidup karena dunia tidak ada yang abadi seperti senja.</p>\r\n', '#####<p>Keputusasaan seseorang dalam mencari cinta di mana pun berada.</p>\r\n', '#####<p>Dalam hidup, manusia akan merasakan ksedihan, kehilangan, dan kesendirian.</p>\r\n', 'C', '2024-06-07 11:14:59', 43, 82),
