(908, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Tampak Ken Arok tidur di suatu tempat yang agak tinggi, sesuatu yang dapat dibayangkan penonton sebagai batu besar atau cabang pohon dan sebangsanya. Tita, sahabat, dan pembantu Ken Arok berdiri di suatu tempat sambil mengamati ke arah rombongan pedagang yang akan datang. Beberapa orang, antara tiga sampai lima orang pendekar, berada di dekatnya juga tampak mengawasi dan gelisah. Latar tempat dari cerita dalam naskah drama tersebut adalah&hellip;</p>\r\n', '#####<p>rumah</p>\r\n', '#####<p>gunung</p>\r\n', '#####<p>kamar</p>\r\n', '#####<p>hutan</p>\r\n', '#####<p>jalan</p>\r\n', 'D', '2024-06-07 11:21:18', 55, 70),
(909, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut!<br />\r\nAmir: &ldquo;Di, kita berangkat sekolah sekarang.&rdquo; (Amir bangkit di depan pintu, kemudian Dodi mendekat). Dodi: &ldquo;Maaf, Mir, tunggu sebentar.&rdquo; (Dodi menyuruh Amir duduk).<br />\r\nAmir: &ldquo;Sebentar, apa lagi yang akan kau kerjakan?&rdquo;<br />\r\nDodi: &ldquo;Biasa, mengisi dua kolam mandi setiap hari.&rdquo;<br />\r\nAmanat cuplikan naskah drama di atas yaitu&hellip;</p>\r\n', '#####<p>Bekerjalah sebaik mungkin</p>\r\n', '#####<p>Jadilah anak yang rajin</p>\r\n', '#####<p>Berangkat sekolah harus lebih pagi</p>\r\n', '#####<p>Selesaikan pekerjaan di rumah dengan baik</p>\r\n', '#####<p>Belajarlah yang rajin</p>\r\n', 'C', '2024-05-27 21:44:33', 48, 77),
(910, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut!<br />\r\nPenjual: &ldquo;Kenapa kamu menangis di situ, Nak?&rdquo;<br />\r\nAna : &ldquo;Maaf, Pak. Suara tangisan saya mengganggu jualan Bapak.&rdquo;<br />\r\nPenjual: &ldquo;Tidak apa-apa, Nak. Kamu kenapa menangis sendirian? Teman-teman kamu mana?&rdquo;<br />\r\nAna : &ldquo;Saya ditinggal teman-teman saya, Pak.&rdquo;<br />\r\nPenjual: &ldquo;Kok bisa?&rdquo;<br />\r\nAna : &ldquo;Nggak ada yang mau boncengin saya, Pak. Sepertinya karena saya gendut sedangkan teman saya yang lain cantik dan kurus.&rdquo;<br />\r\nPenjual: &ldquo;Sabar, ya, Nak. Kamu bisa, kok, kemana-mana sendiri. Sendirian pun bukan masalah besar.&rdquo; Ana : &ldquo;Saya marah dan sedih kenapa mereka mendiskriminasi saya. Padahal saya juga teman mereka.&rdquo;<br />\r\nPenjual: &ldquo;Tidak apa-apa ganti teman, Nak. Untuk apa kamu berteman dengan mereka kalau kamu dibuat sedih? Berteman kan tujuannya agar kita saling berbagai kebahagiaan. Iya, kan?&rdquo;<br />\r\nAna : &ldquo;Iya, benar, Pak. Terima kasih, ya, Pak, sudah menyadarkan saya.&rdquo;<br />\r\nPenjual: Iya, sama-sama, Nak. Jangan bersedih terus, ya.&rdquo;<br />\r\nAmanat yang terkandung dalam penggalan drama tersebut adalah&hellip;</p>\r\n', '#####<p>Jangan sedih berlarut-larut pada suatu masalah hidup.</p>\r\n', '#####<p>Tetaplah berbuat baik pada siapa pun orangnya.</p>\r\n', '#####<p>Kurangi sifat berprasangka buruk pada orang lain.</p>\r\n', '#####<p>Lebih baik intropeksi diri sendiri sebelum menyalahkan orang lain.</p>\r\n', '#####<p>Pentingnya memilih teman yang membawa hal-hal positif.</p>\r\n', 'E', '2024-06-07 11:18:48', 64, 61),
(911, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah kalimat berikut! &ldquo;Selain melukis ekstrakurikuler seni juga akan mempelajari seni rupa drama dan suara. Jadi apakah ada yang bersedia mendaftar tanya Bu Cahya.&rdquo; Perbaikan penggunaan tanda baca yang tepat pada dialog tersebut adalah &hellip;</p>\r\n', '#####<p>&ldquo;Selain melukis, ekstrakurikuler seni juga akan mempelajari seni rupa, drama, dan suara. Jadi, apakah ada yang bersedia mendaftar?&rdquo; tanya Bu Cahya.</p>\r\n', '#####<p>&ldquo;Selain melukis, ekstrakurikuler seni juga akan mempelajari seni rupa, drama dan suara. Jadi, apakah ada yang bersedia mendaftar?&rdquo; tanya Bu Cahya.</p>\r\n', '#####<p>&ldquo;Selain melukis, ekstrakurikuler seni juga akan mempelajari seni rupa, drama, dan suara. Jadi apakah ada yang bersedia mendaftar?&rdquo; Tanya Bu Cahya.</p>\r\n', '#####<p>&ldquo;Selain melukis ekstrakurikuler seni juga akan mempelajari seni rupa, drama, dan suara. Jadi, apakah ada yang bersedia mendaftar?&rdquo; tanya Bu Cahya.</p>\r\n', '#####<p>&ldquo;Selain melukis ekstrakurikuler seni juga akan mempelajari seni rupa, drama, dan suara. Jadi apakah ada yang bersedia mendaftar?&rdquo; tanya Bu Cahya.</p>\r\n', 'A', '2024-06-07 11:19:37', 75, 50),
(912, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut! Awan: &ldquo;Manusia itu aneh. Suka berprasangka pada sesama. Aku lelah memperhatikan mereka dari sini. Tidak ingin dilihat, tapi mereka terus hadir di depanku.&rdquo; Matahari: &ldquo;Kau benar. Namun, akan lebih baik kita memikirkan diri sendiri. Kau terlihat semakin gendut. Bukankah seharusnya kau menjatuhkan airmu?&rdquo; Awan: &ldquo;Nanti dulu, ini masih terik. Pukul empat agar mereka kocar-kacir dan kebingungan untuk pulang ke rumah.&rdquo; Matahari: &ldquo;Dasar jahil.&rdquo; Latar tempat dan waktu pada kutipan teks cerita imajinatif tersebut adalah &hellip;</p>\r\n', '#####<p>langit, sore hari</p>\r\n', '#####<p>langit, pagi hari</p>\r\n', '#####<p>daratan, siang hari</p>\r\n', '#####<p>daratan, sore hari</p>\r\n', '#####<p>langit, siang hari</p>\r\n', 'E', '2024-06-07 11:16:23', 66, 59),
(913, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah kutipan teks berikut! Bunda : &ldquo;Reyhan, bunda minta tolong jangan seperti itu lagi, ya?&rdquo; Reyhan: &ldquo;Memangnya aku bagaimana, Bun? Aku tidak sengaja mendorong Indra. Tadi memang kebetulan Indra ada di dekat aku.&rdquo; Damian: &ldquo;Kamu tolong dewasa sedikit! Kamu sekarang bukan anak kecil lagi! Bagaimana bisa kamu ceroboh? Indra jadi sakit karena terbentur meja!&rdquo; Reyhan: &ldquo;Aku minta maaf. Itu memang bukan murni kesalahanku. Tadi ada kabel jadi aku tersandung dan tidak sengaja mendorong Indra, Bun.&rdquo; Damian: &ldquo;Ini karena Bunda memanjakan Reyhan sebelum Indra lahir. Jadi Reyhan terus membuat Indra celaka. Kamu iri pada Indra, kan? Kamu ingin selamanya jadi anak bungsu, kan?&rdquo; Reyhan: &ldquo;Kak, aku sayang Indra adikku! Aku tidak mungkin seperti itu!&rdquo; Damian: &ldquo;Buktinya ini kesekian kalinya kamu hampir mencelakakan Indra! Kakak macam apa kamu?&rdquo; Bunda: &ldquo;Sudah, Damian. Reyhan, kamu masuk kamar. Sekarang.&rdquo; Suasana yang tergambar dalam cuplikan drama tersebut adalah&hellip;</p>\r\n', '#####<p>Sedih</p>\r\n', '#####<p>Cemas</p>\r\n', '#####<p>Marah</p>\r\n', '#####<p>Tegang</p>\r\n', '#####<p>Haru</p>\r\n', 'D', '2024-06-07 11:27:32', 54, 71),
(914, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut! Penjual: &ldquo;Kenapa kamu menangis di situ, Nak?&rdquo; Ana : &ldquo;Maaf, Pak. Suara tangisan saya mengganggu jualan Bapak.&rdquo; Penjual: &ldquo;Tidak apa-apa, Nak. Kamu kenapa menangis sendirian? Teman-teman kamu mana?&rdquo; Ana : &ldquo;Saya ditinggal teman-teman saya, Pak.&rdquo; Penjual: &ldquo;Kok bisa?&rdquo; Ana : &ldquo;Nggak ada yang mau boncengin saya, Pak. Sepertinya karena saya gendut sedangkan teman saya yang lain cantik dan kurus.&rdquo; Penjual: &ldquo;Sabar, ya, Nak. Kamu bisa, kok, kemana-mana sendiri. Sendirian pun bukan masalah besar.&rdquo; Ana : &ldquo;Saya marah dan sedih kenapa mereka mendiskriminasi saya. Padahal saya juga teman mereka.&rdquo; Penjual: &ldquo;Tidak apa-apa ganti teman, Nak. Untuk apa kamu berteman dengan mereka kalau kamu dibuat sedih? Berteman kan tujuannya agar kita saling berbagai kebahagiaan. Iya, kan?&rdquo; Ana : &ldquo;Iya, benar, Pak. Terima kasih, ya, Pak, sudah menyadarkan saya.&rdquo; Penjual: Iya, sama-sama, Nak. Jangan bersedih terus, ya.&rdquo; Suasana yang tergambar dalam cuplikan drama tersebut adalah&hellip;</p>\r\n', '#####<p>Marah</p>\r\n', '#####<p>Bingung</p>\r\n', '#####<p>Cemas</p>\r\n', '#####<p>Haru</p>\r\n', '#####<p>Sedih</p>\r\n', 'E', '2024-06-07 11:07:18', 82, 43),
(915, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut!<br />\r\nVan Dijk: &ldquo;Tadi kan bilang bahwa istrimu cantik sekali, bukan? Cantik sekali dan kau cinta sekali padanya?&rdquo;<br />\r\nPedagang: &ldquo;Yyya.&rdquo;<br />\r\nVan Dijk: &ldquo;Kau juga mengatakan padaku bahwa kau lebih cinta kepadanya daripada nyawamu sendiri. Masih ingat?&rdquo;<br />\r\nPedagang: &ldquo;Ya!&rdquo;<br />\r\nVan Dijk: &ldquo;Baik, nyawamu akan kuselamatkan. Asal istrimu kau serahkan padaku. Bagaimana, setuju?&rdquo; Pedagang: &ldquo;Setuju, major. Setuju!&rdquo;<br />\r\nVan Dijk: &ldquo;Tadi kau bilang kalau istrimu tak bisa dibeli, kini kau berikan untuk membeli nyawamu. Begitu mudah, begitu enteng!&rdquo;<br />\r\nWatak tokoh Van Dijk dalam penggalan drama tersebut adalah&hellip;</p>\r\n', '#####<p>Penyabar</p>\r\n', '#####<p>Pemarah</p>\r\n', '#####<p>Tegas</p>\r\n', '#####<p>Jahat</p>\r\n', '#####<p>Baik hati</p>\r\n', 'C', '2024-06-07 11:17:15', 48, 77);
