(916, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah teks berikut!<br />\r\nVan Dijk: &ldquo;Tadi kan bilang bahwa istrimu cantik sekali, bukan? Cantik sekali dan kau cinta sekali padanya?&rdquo;<br />\r\nPedagang: &ldquo;Yyya.&rdquo;<br />\r\nVan Dijk: &ldquo;Kau juga mengatakan padaku bahwa kau lebih cinta kepadanya daripada nyawamu sendiri. Masih ingat?&rdquo;<br />\r\nPedagang: &ldquo;Ya!&rdquo;<br />\r\nVan Dijk: &ldquo;Baik, nyawamu akan kuselamatkan. Asal istrimu kau serahkan padaku. Bagaimana, setuju?&rdquo; Pedagang: &ldquo;Setuju, major. Setuju!&rdquo;<br />\r\nVan Dijk: &ldquo;Tadi kau bilang kalau istrimu tak bisa dibeli, kini kau berikan untuk membeli nyawamu. Begitu mudah, begitu enteng!&rdquo;<br />\r\nKonflik dalam penggalan drama tersebut adalah&hellip;</p>\r\n', '#####<p>Van Dijk ingin merebut istri pedagang yang cantik</p>\r\n', '#####<p>Pedagang marah kepada Van Dijk karena istrinya ingin direbut</p>\r\n', '#####<p>Van Dijk ingin membunuh pedagang</p>\r\n', '#####<p>Pedagang yang takut kepada Van Dijk</p>\r\n', '#####<p>Istri pedagang mencintai Van Dijk</p>\r\n', 'A', '2024-05-27 21:41:48', 80, 45),
(917, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Bacalah kutipan teks berikut! Samin :<br />\r\n&ldquo;Fred, jangan cepat-cepat bahaya!&rdquo;<br />\r\nFredi : &ldquo;Alaa, malam begini sepi, tak apa!&rdquo;<br />\r\n(Samin menyusul dan menariknya mundur.)<br />\r\nSamin : &ldquo;Kita berhenti dulu!&rdquo;<br />\r\nFredi : &ldquo;Ah! Lebih cepat sampai ke alamatnya kan lebih baik!&rdquo;<br />\r\nSamin : &ldquo;Ingat yang aku bawa surat penting!&rdquo;<br />\r\nFredi : &ldquo;Justru itu!&rdquo; Samin : &ldquo;Pokoknya berhenti, Fred! Aku tidak mau ambil risiko tertangkap Belanda.&rdquo; Fredi : &ldquo;Baik, Min! Kau yang pegang komando.&rdquo;<br />\r\nTokoh Samin pada penggalan drama di atas bersifat&hellip;</p>\r\n', '#####<p>Penyabar</p>\r\n', '#####<p>Ambisius</p>\r\n', '#####<p>Semangat</p>\r\n', '#####<p>hati-hati</p>\r\n', '#####<p>tanggung jawab</p>\r\n', 'D', '2024-05-27 09:55:25', 69, 56),
