(927, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p>Topik: Upaya Menanamkan Rasa Cinta Kalangan Remaja Terhadap Kesenian Tradisional Indonesia Kalimat latar belakang yang sesuai dengan topik tersebut adalah&hellip;</p>\r\n', '#####<p>Budaya Indonesia telah banyak dipelajari dan digali oleh bangsa asing yang datang ke Indonesia sambil berdarma wisata.</p>\r\n', '#####<p>Ternyata budaya yang masuk ke Indonesia banyak merusak citra budaya kesenian yang sudah ada di tanah air Indonesia.</p>\r\n', '#####<p>Zaman sekarang banyak remaja kita yang berbangga diri apabila mengenal dan menguasai kesenian orang asing daripada kesenian bangsanya sendiri.</p>\r\n', '#####<p>Saat ini semakin banyaknya kesenian kita yang sudah tercemar dengan aliran barat atau asing khususnya di kalangan remaja dan pelajar.</p>\r\n', '#####<p>Dewasa ini, orang asing yang tinggal di Indonesia yang sedang memelajari kesenian dan budaya Indonesia secara mendalam.</p>\r\n', 'C', '2024-06-07 11:12:51', 45, 80),
