(931, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\">Bacalah teks berikut!<br />\r\nSalah satu jenis makanan cepat saji yang paling diminati masyarakat adalah makanan kaleng. Makanan kaleng dapat berisi ikan, daging, sayuran, hingga buah. Adanya makanan kaleng tersebut memberi keuntungan bagi masyarakat. Keuntungan yang dirasakan diantaranya menghemat waktu penyajian dan memiliki kandungan gizi yang cukup.<br />\r\nPernyataan yang sesuai dengan kutipan karya ilmiah tersebut adalah&hellip;</p>\r\n', '#####<p>Tingkat penjualan makanan kaleng sangat tinggi</p>\r\n', '#####<p>Masyarakat gemar mengonsumsi makanan kaleng</p>\r\n', '#####<p>Dampak negatif mengonsumsi makanan kaleng</p>\r\n', '#####<p>Berbagai jenis makanan kaleng sangat laris</p>\r\n', '#####<p>Kandungan gizi yang terkandung dalam makanan kaleng</p>\r\n', 'B', '2024-06-07 11:18:18', 50, 75),
(932, 25, 41, 3, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\">Bacalah teks berikut!<br />\r\nMasalah kenakalan remaja di Indonesia dirasa telah mencapai tingkat yang cukup meresahkan masyarakat. Akhir-akhir ini masalah kenakalan remaja cenderung menjadi masalah nasional yang dirasa semakin sulit untuk dihindari, ditanggulangi, dan diperbaiki kembali. Munculnya kenakalan remaja tanpa disadari dapat menimbulkan berbagai masalah. Masalah tersebut antara lain mengganggu ketertiban dan kenyamanan orang lain, membahayakan diri remaja itu sendiri, dan meningkatkan angka kriminalitas. Topik karya ilmiah tersebut adalah&hellip;</p>\r\n', '#####<p>Masalah akibat kenakalan remaja</p>\r\n', '#####<p>Cara menanggulangi masalah kenakalan remaja</p>\r\n', '#####<p>Ruang lingkup kenakalan remaja</p>\r\n', '#####<p>Upaya mengurangi tingkat kenakalan remaja</p>\r\n', '#####<p>Faktor-faktor penyebab kenakalan remaja</p>\r\n', 'A', '2024-06-07 11:23:10', 84, 41),
