(1048, 23, 50, 1, 2, NULL, NULL, 'multiple', '“Raja tinggal di istana kerajaan yang disusun atas bangunan bertingkat yang besar, mempunyai atap dari daun aren, singgasana dari gading gajah, banyak emas dan perak, penduduknya pandai membuat arak dari nila”. Hal ini menunjukan sebagian dari informasi tentang kerajaan...', '#####Tarumanagara.', '#####Melayu.', '#####Kalingga.', '#####Sriwijaya.', '#####Kediri.', 'C', '2024-05-27 20:45:17', 8, 43),
(1049, 23, 50, 1, 2, NULL, NULL, 'multiple', 'Masa pemerintahan Kertanagara diwarnai ambisi ekspansionis, yaitu meluaskan wilayah kerajaan ke seluruh wilayah nusantara, baik dengan cara penaklukan maupun dengan membina pershabatan. Sebagai salah satu realisasi dari cita-cita politiknya adalah pengiriman arca Amoghapasa, sebagai tanda persahabatan dengan kerajaan...', '#####Sriwijaya.', '#####Melayu.', '#####Pagaruyung.', '#####Malaka.', '#####Kutai.', 'B', '2024-05-27 20:45:17', 18, 33),
