(1075, 23, 50, 1, 2, NULL, NULL, 'multiple', 'Kehadiran agama Islam di Nusantara  menimbulkan akulturasi antara budaya lokal, Hindu-Budha, dan Islam. Contohnya, tehnik stilisasi dalam seni rupa dan munculnya aksara Arab Melayu (Arab Gundul). Selain itu dalam bidang sosial dan pemerintahan digunakannya gelar-gelar yang berasal dari bahasa Arab, seperti sultan, susuhunan dan khlifah. Dalam sistem penanggalan atau kalender Saka dari masa Hindu-Budha dan kalender Islam, yaitu kalender Jawa. Berdasarkan narasi tersebut, simpulan paling tepat adalah masyarakat Nusantara...', '#####Mengadopsi ajaran Islam secara utuh, tampa penyesuaian dengan ajaran lokal', '#####Secara bebas menyesuaikan ajaran Islam dengan kebudayaan lokal dan Hindu-Budha', '#####Menyesuaikan agama islam dengan kebudayaan yang telah ada sebelumnya, sesuai ajaran islam', '#####Menerima agama Islam dan menyingkirkan kebudayaan yang ada sebelumnya sesuai ajaran islam', '#####Mempertahankan kebudayaan yang sudah ada sebelum datangnya ajaran Islam', 'C', '2024-05-27 20:45:17', 21, 30),
