(1149, 22, 44, 3, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\">Negara Hastinapura kagungan putra calon gumanti Nata, yaiku kang pambareb Dhestrarastra, panengahe Pandu, lan warujune Widura. Dhestrarastra, Pandu Dewanata, lan Widura digulawentah lan digladhi dening Resi Bisma. Katelune iku kang bakal mbacutake keprabone dharah Kuru.Drestharastra duwe kaluwihan prigel olah jaya kawijayan. Pandu prigel babagan olah kridhaning jemparing, dene Wisura prigel babagan olah weliding pedhang lan sanjata./Nanging kang jumeneng nata ing Hastina iku Pandu, jalaran Dhestarastra cacat netra, dene Widura duwe cacat sukune dawa sesisih.Saka sarasehan agung netepake kang dijenengake nata Pandu. Dhestarastra lila yen sing kawisudha dadi ratu iku Pandu, amarga dheweke nglenggana duwe kekurangan kang ginaris dening Gusti Kang Murbeng Jagad. Miturut pemanggihe, nagara kang dipangarsani titah kang cacat bakal nuwuhake swasana kang ora becik./Dhestarastra krama karo Dewi Gendari (sedulure Sengkuni) putri ratu Basubala (Suwala) ing nagara Gandara duwe putra cacah satus kang diwastani Kurawa. Pandu krama karo putri loro, yaiku Dewi Kunti (Dewi Patra) putrine Prabu Kuntiboja peputra telu Yudhistira, Bima, lan Arjuna. Nanging sadurunge karo Prabu Pandu, Dewi Kunti wis kagungan putra kang arane Karna. Dene garwa Pandu sijine asesilih Dewi Madrim, putri Ratu Mandrapati ing Nagara Mandrawisaya (Mandaraka), peputra loro kembar Nakula lan Sadewa. Widura krama karo Dewi Parasari, putra Maharaja Dewaka sarta kagungan putra kekasih Wiyansampana (Sunjaya).<br />\r\nParaga utama ing crita kasebut yaiku ....</p>\r\n', '#####<p>Prabu Pandu</p>\r\n', '#####<p>Prabu Dhestarasta</p>\r\n', '#####<p>Widura</p>\r\n', '#####<p>Prabu Matswapati</p>\r\n', '#####<p>Prabu Salya</p>\r\n', 'A', '2024-06-06 08:19:26', 41, 39),
(1150, 22, 44, 3, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\">Negara Hastinapura kagungan putra calon gumanti Nata, yaiku kang pambareb Dhestrarastra, panengahe Pandu, lan warujune Widura. Dhestrarastra, Pandu Dewanata, lan Widura digulawentah lan digladhi dening Resi Bisma. Katelune iku kang bakal mbacutake keprabone dharah Kuru.Drestharastra duwe kaluwihan prigel olah jaya kawijayan. Pandu prigel babagan olah kridhaning jemparing, dene Wisura prigel babagan olah weliding pedhang lan sanjata.<br />\r\nNanging kang jumeneng nata ing Hastina iku Pandu, jalaran Dhestarastra cacat netra, dene Widura duwe cacat sukune dawa sesisih.Saka sarasehan agung netepake kang dijenengake nata Pandu. Dhestarastra lila yen sing kawisudha dadi ratu iku Pandu, amarga dheweke nglenggana duwe kekurangan kang ginaris dening Gusti Kang Murbeng Jagad. Miturut pemanggihe, nagara kang dipangarsani titah kang cacat bakal nuwuhake swasana kang ora becik.<br />\r\nDhestarastra krama karo Dewi Gendari (sedulure Sengkuni) putri ratu Basubala (Suwala) ing nagara Gandara duwe putra cacah satus kang diwastani Kurawa. Pandu krama karo putri loro, yaiku Dewi Kunti (Dewi Patra) putrine Prabu Kuntiboja peputra telu Yudhistira, Bima, lan Arjuna. Nanging sadurunge karo Prabu Pandu, Dewi Kunti wis kagungan putra kang arane Karna. Dene garwa Pandu sijine asesilih Dewi Madrim, putri Ratu Mandrapati ing Nagara Mandrawisaya (Mandaraka), peputra loro kembar Nakula lan Sadewa. Widura krama karo Dewi Parasari, putra Maharaja Dewaka sarta kagungan putra kekasih Wiyansampana (Sunjaya).<br />\r\nLatar crita iku yaiku ...</p>\r\n', '#####<p>Mandaraka</p>\r\n', '#####<p>Suwala</p>\r\n', '#####<p>Hastinapura</p>\r\n', '#####<p>Gandara</p>\r\n', '#####<p>Dewaka</p>\r\n', 'C', '2024-06-06 13:43:02', 51, 29),
