(1324, 14, 40, 1, 4, NULL, NULL, 'multiple', '<p>Hendak dibuat kalender dengan model seperti gambar berikut. Jelas terlihat dałam 2 bulan diberi satu foto. Jika ada 10 stok foto yang tersedia, berapa banyak model kalender yang dapat dibuat&hellip;..</p>\r\n', '#####<p>151.100 model</p>\r\n', '#####<p>151.200 model</p>\r\n', '#####<p>151.300 model</p>\r\n', '#####<p>151.400 model</p>\r\n', '#####<p>151.500 model</p>\r\n', 'B', '2024-05-28 01:43:58', 25, 28),
(1325, 14, 40, 1, 4, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\">Anita membuat kalung manik-manik seperti gambar berikut. Pada bagian depan, terdiri atas lima manik-manik berbentuk bunga besar dengan warna berbeda: kuning, ungu, merah muda, jingga, dan hijau. Jika susunan kelima manik-manik iłu diubah-ubah, berapa banyak variasi susunan manikmanik iłu? (Keterangan: ingat bahwa dua susunan berbeda bisa menjadi sama saat posisi&nbsp;kalung&nbsp;dibalik)</p>\r\n', '#####<p>28 varian</p>\r\n', '#####<p>26 varian</p>\r\n', '#####<p>24 varian</p>\r\n', '#####<p>22 varian</p>\r\n', '#####<p>20 varian</p>\r\n', 'C', '2024-05-28 01:43:33', 16, 37),
(1326, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"line-height:107%\">ANNOUNCEMENT</span></span></strong></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong>To&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Grade X students of SMK NEPAL</strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong>From : Mrs. ERMA UJIYANTI</strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong>Dear students,</strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong>There will be an English&nbsp; Class&nbsp; started from Wednesday 7th &ndash; 30th June 2021. All student must attend&nbsp; this class based on the given schedule that will be shared through WAG of your own classroom.&nbsp; Please register yourself to your own class leader before join this class. Thank you.</strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong>Ms. PARADISA AZZAHRA<br />\r\nThe leader of NEPAL ENGLISH HALL</strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Who wrote the announcement above?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Every class leader</span></span></span></p>\r\