(1337, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ladies and gentlemen, welcome on Argo Parahyangan train that will take us to Gambir for the last destination station. This train will travel for 3 hours and 4 minutes. For any service or information you can contact all crew in our trip today. For your safety, we remind you to keep all your belongings and please do not smoke on the train in the toilet or in the borders. Have a nice trip and thank you.</span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which is true according to the text?</span></span></span></span></span></span></p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The train will depart from Gambir station.</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The passangers allow to smoke on the train if they want to.</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The train will travel for 184 minutes.</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The toilet in the train is out of order.</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'C', '2024-05-28 09:57:38', NULL, NULL),
