thic&quot;,sans-serif\">-The topic of articles about education, traditional art, or health.</span></span></span></strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Century Gothic&quot;,sans-serif\">It also required to write down the meaning&nbsp; in Indonesian. All articles need to be submitted to my desk at the maximum next week on Wednesday, 18 November 2020. Thank you.</span></span></span></strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Century Gothic&quot;,sans-serif\">English Teacher,</span></span></span></strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Century Gothic&quot;,sans-serif\">Mr. Brown</span></span></span></strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">When the due time of submission?</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">On the weekend</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style