(1332, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:28.15pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Dear. All BNI Credit Card Holders,<br />\r\nIn connection with the Covid-19 outbreak, for the time being the Lembayung Lounge at<br />\r\nSultan Syarif Kasim II Airport in Pekanbaru has restricted operating hours from 05.00 WIB to the last flight to 09.00 WIB to 17.00 WIB. This limitation of operating hours applies from April 3, 2020 until further notice.</span></span></span></span><br />\r\n<span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">What does the main idea of the annoucement?</span></span></span></p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">To announce Covid &ndash; 19. </span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">To announce restricted operation airport.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">To&nbsp; announce limited of operation airport. </span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">To announce restricted operation the Lambayung Lounge.</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-28 09:42:10', NULL, NULL),
(1333, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">Announcement<br />\r\nThis Thursday is August 17th, the Independence day .<br />\r\nDon&#39;t miss the Independence Day festival!<br />\r\nThe festival begins at 08.00 in every district In Jakarta.<br />\r\nGather in front of our school at 07.30 to see the parade with the principal.<br />\r\nDon&#39;t miss it! And Join many contests at school.<br />\r\nFree registration, full of prizes!</span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">What does the text tell about?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">Gathering in school</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;Parade with the principal</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">Independence Day festival</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">School contest</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'C', '2024-05-28 09:44:19', NULL, NULL),
(1334, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Annoucement</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">To all of teachers. To prevent the spread of the corona viruse, please obey the New normal rules in our school. First, Wash your hands and have temperature taken before entering the office. Second, always wear protective face mask. Third, Implement physical distancing in all of activities</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Thank you for your attention</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Headmaster</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">From the text we know that all of teachers&hellip;..</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">should not come to school to prevent corona viruse</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">must wear protective mask in their activities</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">are prohibited to have temperature taken</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">are allowed to get closed with others</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-28 09:46:49', NULL, NULL),
