(1346, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:10pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Lisa : Why did you .......... late this morning?</span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\">J<span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">eni: I&rsquo;m sorry. I had to go because I forgot to bring my notebook. It was really important for me.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '#####<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Come</span></span></span></p>\r\n', '#####<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Coming</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '#####<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Was come</span></span></span></p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Had come</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-28 10:22:45', NULL, NULL),
(1347, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Rena&nbsp;&nbsp;&nbsp; : I missed Miss Lina&rsquo;s class yesterday. Did she give any assignment?</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Diana&nbsp;&nbsp; : No. It ...........interesting yesterday. We argued over our market research topic.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Rena&nbsp;&nbsp;&nbsp; : Oh really? What happened?</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the topic of the dialogue?</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:106%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:106%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Was</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:106%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><spa