(1350, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><strong><em><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Read the dialogue and answer the question!</span></span></span></em></strong></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Juan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Good morning, Kevin. You arrived on time, but almost late. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kevin&nbsp;&nbsp;&nbsp;&nbsp; : Good morning, Juan. Yeah, I woke up late. I forgot to set my alarm last night. Luckily, I&rsquo;m still able to arrive on time.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Juan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : How about the assignment? Have you finished it? </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kevin&nbsp;&nbsp;&nbsp;&nbsp; : Yup, that&rsquo;s why I woke up late. I worked on the assignment all night long. And of course it&rsquo;s done </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Juan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Good job, Kevin! Don&rsquo;t forget to submit it to the manager. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kevin&nbsp;&nbsp;&nbsp;&nbsp; : Ok. </span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The following statements are true about the dialogue, except. .&nbsp; .</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '#####<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kevin arrived almost late</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '#####<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kevin finished the assignment</span></span></span></span></span></span></p>\r\n\r\n