INSERT INTO `m_soal` (`id`, `id_guru`, `id_mapel`, `id_kelas`, `bobot`, `file`, `tipe_file`, `jenis_soal`, `soal`, `opsi_a`, `opsi_b`, `opsi_c`, `opsi_d`, `opsi_e`, `jawaban`, `tgl_input`, `jml_benar`, `jml_salah`) VALUES
(1351, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Once, a hunter lived a village. He used to boast of his brave hunting trips to the villagers. The villagers respected him a lot. He mostly told everyone how he had fought a lion bare-handed. He said that the tiny animals used to get scared even at the sight of him.</span></span></span><br />\r\n<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">One day, the hunter was passing through a forest. He met a woodcutter from the same village.<br />\r\nThe boastful hunter approached him and said, &ldquo;How are you? it&rsquo;s a fine day, isn&rsquo;t it?&rdquo;<br />\r\n&ldquo;Yes, yes, indeed!&rdquo; the woodcutter replied.<br />\r\n&ldquo;Well, can you tell me if you have seen some footprints of the lion nearby? it&rsquo;s been months since i defeated any.&rdquo;<br />\r\nThe woodcutter knew that the hunter only boasted, so he said, &ldquo;Yes, a lion is in a nearby den. Can i take you there?&rdquo;</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The scared hunter said, &ldquo;No &hellip; No &hellip; i only just wanted to see his footprints.&rdquo;<br />\r\nFinally, the boastful hunter ran away from the spot.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the best title for the text?</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Boastful Hunter</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Brave woodcutter</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A Woodcutter&rsquo;s Advice</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;A Woodcutter&rsquo;s Rewards</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-29 11:36:04', NULL, NULL),
(1352, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Once, a hunter lived a village. He used to boast of his brave hunting trips to the villagers. The villagers respected him a lot. He mostly told everyone how he had fought a lion bare-handed. He said that the tiny animals used to get scared even at the sight of him.</span></span></span><br />\r\n<span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">One day, the hunter was passing through a forest. He met a woodcutter from the same village.<br />\r\nThe boastful hunter approached him and said, &ldquo;How are you? it&rsquo;s a fine day, isn&rsquo;t it?&rdquo;<br />\r\n&ldquo;Yes, yes, indeed!&rdquo; the woodcutter replied.<br />\r\n&ldquo;Well, can you tell me if you have seen some footprints of the lion nearby? it&rsquo;s been months since i defeated any.&rdquo;<br />\r\nThe woodcutter knew that the hunter only boasted, so he said, &ldquo;Yes, a lion is in a nearby den. Can i take you there?&rdquo;</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The scared hunter said, &ldquo;No &hellip; No &hellip; i only just wanted to see his footprints.&rdquo;<br />\r\nFinally, the boastful hunter ran away from the spot.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What did the hunter boast about himself?</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Nobody defeated him.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">He was the smartest man.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">He was the strongest man.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">He was the most courageous man.</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 11:38:00', NULL, NULL),
(1353, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&ldquo;Away with you, vile insect!&rdquo; said a lion angruly to a gnat that was buzzing around his head, but the Gnat was not in the least disturbed.<br />\r\n&ldquo;do you think.&rdquo; he said spitefully the lion, &ldquo;that i am afraid of you because they call you king?&rdquo;<br />\r\nThe next instant he flew at the lion and stung him sharply on the nose. Mad with rage, the lion struck fiercely at the Gnat, but only succeeded in tearing himself with his claws. Again and again the Gnat stung the Lion, who now was roaring terribly. At last, worn out with rage and covered with wounds that his own teeth and claws had made, the Lion gave up the fight.<br />\r\nThe Gnat buzzed away to tell whose world about his victory, but instead he flew straight into a spider&rsquo;s web. And there, he who had defeated the king of beasts came to miserable end, the prey of a little spider.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The text tell us about &hellip;.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a lion which is annoyed by a gnat</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">confrontation between a lion and a spider</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a gnat which loved to sting other animals</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a good relationship between a lion and a spider</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-29 11:39:35', NULL, NULL),
(1354, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&ldquo;Away with you, vile insect!&rdquo; said a lion angruly to a gnat that was buzzing around his head, but the Gnat was not in the least disturbed.<br />\r\n&ldquo;do you think.&rdquo; he said spitefully the lion, &ldquo;that i am afraid of you because they call you king?&rdquo;<br />\r\nThe next instant he flew at the lion and stung him sharply on the nose. Mad with rage, the lion struck fiercely at the Gnat, but only succeeded in tearing himself with his claws. Again and again the Gnat stung the Lion, who now was roaring terribly. At last, worn out with rage and covered with wounds that his own teeth and claws had made, the Lion gave up the fight.<br />\r\nThe Gnat buzzed away to tell whose world about his victory, but instead he flew straight into a spider&rsquo;s web. And there, he who had defeated the king of beasts came to miserable end, the prey of a little spider.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Why did the lion give up hitting the gnat?</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;The lion only wounded itself</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The gnat stopped stinging the lion</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The lion felt nothing from the sting</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The gnat flew to bother th spider</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-29 11:41:16', NULL, NULL),
(1355, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p style=\"text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Once upon a time there was a rose who was very proud of its beautiful looks. Its only disappointment was that it grew next to an ugly cactus. Every day, the rose would insult he cactus on its looks while the cactus stayed quiet. All the other plants in the garden tried to make the rose see sense, but it was too swayed by it own good looks.<br />\r\nOne summer, the well in the garden grew dry and there was no water for the plants. The rose began to wilt. I tsaw a sparrow dip its beak into the cactus for some water. Though ashamed, the rose asked the cactus if it could have some water too. The cactus readily agreed and they both got through the tough summer as friends.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the story about?</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Two different, but special plants.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A beautiful, but arrogant rose.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Two plants in a beautiful garden.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A beautiful rose and an ugly cactus.</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 11:43:06', NULL, NULL),
(1356, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">One day several boys were playing at the edge of a pond in which lived a family of frogs. The boys amused themeselves by throwing stones into the pond so as to make them skip on top of the water.<br />\r\nThe stones were flying thick and fast, and the boys were enjoying themselves very much; but the poor frogs in the pond were trembling with fear.<br />\r\nAt last one of the frogs, the oldest and bravest, put his head out of the water, and said &rdquo; Oh, please, dear children, stop your cruel play! Though it may be fun for you, it mean death to us!&rdquo;</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Why did the frog feel insecure?</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The boy frightened them.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The stone would hurt them.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The boys destroyed the pond.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The water in the pond got dirty.</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-29 11:44:45', NULL, NULL),
(1357, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A Milkmaid had been in the meadow to milk her cows. Now she was returning home with a pail of milk on her hand.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She thought, &quot;I will make cream and butter out of this milk. Then after selling them, I will buy eggs. And when they hatch, I shall have a good poultry farm&quot;.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She further thought, &quot;I shall sell some of my chickens and buy a fine dress. Seeing it on my body at the party, all the boys will admire me. But I will turn them away&quot;.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She went on day dreaming; she forgot about the pail on her head. She moved her head suddenly and the pail of milk came tumbling down. It was broken and all the milk split.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&quot;Dear, 0 dear!&quot; she cried, &quot;I have lost mine all&quot;.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What did the milk-maid carry on her hand?</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Some cream</span></span></span></span></span></span></p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;Some butter</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A pail of milk</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A pail of eggs</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'C', '2024-05-29 11:46:24', NULL, NULL),
(1358, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A Milkmaid had been in the meadow to milk her cows. Now she was returning home with a pail of milk on her hand.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She thought, &quot;I will make cream and butter out of this milk. Then after selling them, I will buy eggs. And when they hatch, I shall have a good poultry farm&quot;.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She further thought, &quot;I shall sell some of my chickens and buy a fine dress. Seeing it on my body at the party, all the boys will admire me. But I will turn them away&quot;.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">She went on day dreaming; she forgot about the pail on her head. She moved her head suddenly and the pail of milk came tumbling down. It was broken and all the milk split.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span styl