(1369, 19, 39, 1, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tangkuban Perahu</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Dayang Sumbi was exiled in the jungle, because she was unmarried but pregnant.&nbsp; She gave a birth to a baby boy and named him Sangkuriang .&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">One day he went hunting with his dog, si Tumang. In the bush he saw a pig, Wayungyang.&nbsp; He wanted to shoot Wayungyang but si Tumang hindered him. He was angry at it and killed it, and then took its heart home. When he told that it was si Tumang&rsquo;s heart, she was very angry and hit Sang Kuriang&rsquo;s head with a spoon.&nbsp; And he ran away and left his mother to the east.&nbsp; He did not know himself and forgot his name. He was about 16 years of age.</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">After along time Sang Kuriang came back to the jungle where his mother lived.&nbsp; She looked younger than her age, so Sang Kuriang fell in love with her.&nbsp; &ldquo;Will you marry me?&rsquo;&rsquo; one day he asked her. But Dayang Sumbi refused because she recognized that he was her son. He insisted to marry her and Dayang Sumbi asked two marriage settlements.&nbsp; One, he had to dammed Citarum river, and two, had to make a boat in one night</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sang Kuriang almost finished his work but Dayang Sumbi cheated him.&nbsp; He was angry and kicked the boat.&nbsp; The boat fell upside down on the peak of mountain. It was known Tangkuban Perahu, at the northern of Bandung, West Java.</span></span></span></span></span></span><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Where is the legend from? It is from ...</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">East Java</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">West Java</span></span></span></span></span></span></p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Central Java</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">North Java</span></span></span></span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-29 12:18:17', NULL, NULL),
