(1376, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 1<br />\r\nLadies and Gentlemen, in case of emergency, take the life jacket which is located under your seat.<br />\r\nPut the life jacket over your head and then fasten the jacket tapes around you&rsquo;re your waist.<br />\r\nDo not inflate the jacket until you left the aircraft. The jacket will be automatically inflated by pulling a cord, but if not, you can blow into the chip to inflate it.<br />\r\nA light is attached to the jacket for attracting attention. The life jacket should be removed only in case of emergency.<br />\r\nThe use of TV set, AM and FM radios and radio cassettes recorders, walkman, and any mobile phones are prohibited on board as they interfere the communication and navigational system.<br />\r\nWe wish you an enjoyable flight.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Where is the life jacket located?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Over the head</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Around the waist.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Outsite the aircraft.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">In the back of the seat.</span></span></span></p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">In the back of the seat.</span></span></span></p>\r\n', 'A', '2024-05-29 12:34:25', NULL, NULL),
(1377, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 1<br />\r\nLadies and Gentlemen, in case of emergency, take the life jacket which is located under your seat.<br />\r\nPut the life jacket over your head and then fasten the jacket tapes around you&rsquo;re your waist.<br />\r\nDo not inflate the jacket until you left the aircraft. The jacket will be automatically inflated by pulling a cord, but if not, you can blow into the chip to inflate it.<br />\r\nA light is attached to the jacket for attracting attention. The life jacket should be removed only in case of emergency.<br />\r\nThe use of TV set, AM and FM radios and radio cassettes recorders, walkman, and any mobile phones are prohibited on board as they interfere the communication and navigational system.<br />\r\nWe wish you an enjoyable flight.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What can interfere the navigation system?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Table.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The life jacket.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mobile phones</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The attached light.</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-29 12:36:12', NULL, NULL),
(1378, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 2<br />\r\nA quick and easy cheese cake recipe<br />\r\nYield : 6 servings<br />\r\nPrep. Time :5 minutes<br />\r\nCook Time : 40 minutes<br />\r\nTotal Time : 45 minutes</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ingredients:<br />\r\n16 ounces cream cheese, 2 packages, softened<br />\r\n&frac12; cup sugar<br />\r\n&frac12; teaspoon vanilla<br />\r\n2 large eggs<br />\r\n4 ounces semi-sweet chocolate chips<br />\r\n1 prepared Graham cracker crust</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Directions:<br />\r\nBeat cream cheese, sugar and vanilla at medium speed until well-blended. Blend in 2 eggs. Stir in chocolate chips then pour batter into Graham cracker chust. (you may sprinkle &frac14; cup mini semi sweet chocolate chips on top if you desire).<br />\r\nBake at 35calcius for 40 minutes, or until certer is almost set. Cool.<br />\r\nFor best results refrigerate for 3 hours.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How many persons is the cake for?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">5</span></span></span></p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">6</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p>35</p>\r\n', '#####<p>E</p>\r\n', 'C', '2024-05-29 12:37:48', NULL, NULL),
