(1381, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 3<br />\r\nHow to make a Cheese Omelet<br />\r\nIngredients:<br />\r\n1 egg, 50 g cheese, 1 cup milk, 3 tablespoons cooking oil, a pinch of salt and pepper.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Utensils:<br />\r\nFrying pan, fork, spatula, cheese-grater, bowl, and plate.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Method:<br />\r\n&bull; Crack the egg into a bowl<br />\r\n&bull; Whisk the egg with a fork until it&rsquo;s smooth<br />\r\n&bull; Add milk and whisk well<br />\r\n&bull; Grate the cheese into the bowl and stir<br />\r\n&bull; Heat the oil in frying pan<br />\r\n&bull; Turn the omelet with spatula and cook both sides<br />\r\n&bull; Place on a plate, season with salt and pepper</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The text above belongs to&hellip;&hellip;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Narrative</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Procedure</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">news item</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"fon