(1387, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 4<br />\r\nRecipe for French Toast<br />\r\nYou are going to need:<br />\r\n4 pieces of bread<br />\r\n1 spoon of sugar<br />\r\n2 eggs<br />\r\nA quarter of a cup of milk<br />\r\nButter<br />\r\nPan<br />\r\nFork<br />\r\nBowl</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Before you start to cook, you have to read the recipe.<br />\r\nNow you can get ready. After you read the recipe, put everything on the counter.<br />\r\nWhen everything is ready, break the eggs, pour a quarter of the milk in the bowl, then add a small spoon of sugar. Mix the eggs, milk and sugar.<br />\r\nNext, put a piece of bread in the bowl with the eggs, milk and sugar. Turn over the bread.<br />\r\nNow, put some butter in the pan. Turn on the stove. When the pan is hot, take the bread out of the bowl and put it into the pan. After you cook one side of the bread, cook the other side. After you finish the first place of the bread, cook the other pieces. Now you have French toast!</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The type of the text above is called &hellip;..</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Recount</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Narrative</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Description</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Procedure</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 12:49:13', NULL, NULL),
