eight:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">to tell the reader how to make French toast</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">to entertain the reader with French toast</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'C', '2024-05-29 12:50:39', NULL, NULL);
