(1392, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 5<br />\r\nHow to Make Starfruit Punch<br />\r\nIngredients<br />\r\n&bull; 250 gr yellow starfruit in slices<br />\r\n&bull; 100 ml water 2 spoonful of vanilla<br />\r\n&bull; 8 teaspoonful of lemonade extract Procedure<br />\r\n&bull; Put slices of starfruit and water in the blender. Wait until it&rsquo;s soft. Skim it.<br />\r\n&bull; Add syrup, lemonade extract, and soda water. Stir thoroughly.<br />\r\n&bull; Pour it in the glass and put in the ice cubes.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the text about?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How to make starfruit punch</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The ingredients of starfruit punch</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How to use blender</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">How to stir thoroughly</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-29 12:56:10', NULL, NULL),
(1393, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How to Make Starfruit Punch<br />\r\nIngredients<br />\r\n&bull; 250 gr yellow starfruit in slices<br />\r\n&bull; 100 ml water 2 spoonful of vanilla<br />\r\n&bull; 8 teaspoonful of lemonade extract Procedure<br />\r\n&bull; Put slices of starfruit and water in the blender. Wait until it&rsquo;s soft. Skim it.<br />\r\n&bull; Add syrup, lemonade extract, and soda water. Stir thoroughly.<br />\r\n&bull; Pour it in the glass and put in the ice cubes.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&hellip;..lemonade extract and soda water. Stir thoroughly. The word &ldquo;stir&ldquo; means&hellip;.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">to make smooth</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">to boil</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">to cut</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">to move an object in order to mix it</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 12:57:38', NULL, NULL),
(1394, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How to Make Starfruit Punch<br />\r\nIngredients<br />\r\n&bull; 250 gr yellow starfruit in slices<br />\r\n&bull; 100 ml water 2 spoonful of vanilla<br />\r\n&bull; 8 teaspoonful of lemonade extract Procedure<br />\r\n&bull; Put slices of starfruit and water in the blender. Wait until it&rsquo;s soft. Skim it.<br />\r\n&bull; Add syrup, lemonade extract, and soda water. Stir thoroughly.<br />\r\n&bull; Pour it in the glass and put in the ice cubes.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which of the following procedures is true?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Put slices of starfruit in the glass.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Put ice cubes in the blender.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Skim two spoonful of vanilla.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Skim the slices of starfruit and water which have already been softened</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 12:59:12', NULL, NULL),
(1395, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 6<br />\r\nBurning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.<br />\r\nInstructions Burning with two CD Trays<br />\r\n1. Insert the CD from which you want to burn music into your computer&rsquo;s CD tray. Insert a blank CD into your computer&rsquo;s second CD tray.<br />\r\n2. Open windows media player and wait for it to recognize the CD.<br />\r\n3. Click the &ldquo;burn&rdquo; option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled &ldquo;Burn List&rdquo;.<br />\r\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.<br />\r\n5. Click the &ldquo;Start Burn&rdquo; button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the topic of the text?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Running two CDs.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Opening Media Player.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Copying a compact disc.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Choosing the blank CD.</span></span></span></p>\r\n', '#####', 'C', '2024-05-29 13:00:30', NULL, NULL),
(1396, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.<br />\r\nInstructions Burning with two CD Trays<br />\r\n1. Insert the CD from which you want to burn music into your computer&rsquo;s CD tray. Insert a blank CD into your computer&rsquo;s second CD tray.<br />\r\n2. Open windows media player and wait for it to recognize the CD.<br />\r\n3. Click the &ldquo;burn&rdquo; option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled &ldquo;Burn List&rdquo;.<br />\r\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.<br />\r\n5. Click the &ldquo;Start Burn&rdquo; button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What should we do after click the &ldquo;burn&rdquo; option at the top of Windows Media Player?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Choose the blank CD onto which you want to burn your song.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Open windows media player and wait for it to recognize the CD.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Wait for your computer to finish the CD, then take both CDs out.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Drag the songs from the list of Songs</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'D', '2024-05-29 13:01:56', NULL, NULL),
(1397, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.<br />\r\nInstructions Burning with two CD Trays<br />\r\n1. Insert the CD from which you want to burn music into your computer&rsquo;s CD tray. Insert a blank CD into your computer&rsquo;s second CD tray.<br />\r\n2. Open windows media player and wait for it to recognize the CD.<br />\r\n3. Click the &ldquo;burn&rdquo; option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled &ldquo;Burn List&rdquo;.<br />\r\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.<br />\r\n5. Click the &ldquo;Start Burn&rdquo; button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&ldquo;The process of copying CD is possible with any computer&hellip;&rdquo; The word &ldquo;possible&rdquo; is closest in meaning to&hellip;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Improbable</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Probable</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Unlikely</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Doubtful</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-29 13:03:37', NULL, NULL),
(1398, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Text 7<br />\r\nIngredients<br />\r\n1 tb margarine, dairy free<br />\r\n1 tb Vegetables oil<br />\r\n1 c onion &ndash; chopped<br />\r\n8 oz Mushrooms &ndash; sliced<br />\r\n1 lg Garlic clove &ndash; minced<br />\r\n1/3 celery &ndash; thinly sliced<br />\r\n3 c Soybean milk<br />\r\n4 c Potatoes &ndash; cubed &frac12; inch<br />\r\n&frac14; ts Black pepper<br />\r\n1 ts Salt, or to taste<br />\r\n1 tb Parsley &ndash; chopped</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Directions<br />\r\n1. Saute onion, garlic, celery, and green pepper in hot oil and margarine about 3 minutes. Add sliced mushrooms and saut&eacute; 3 more minutes.<br />\r\n2. Add soybean milk, black pepper, salt and potatoes. Bring mixture almost to a boil; reduce heat and simmer 25 minutes, stirring occasionally.<br />\r\n3. Make about 6 cups. Thin with extra soybean milk if soup is too thick.<br />\r\n4. Garnish with parsley and serve with the veal.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The text states that &hellip;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">extra soybean milk must be added if the soup is too thick</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">six cups of soy bean milk must be added to the soup</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">soybean milk is used merely for garnish</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">extra cups must be provided for everybody</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'A', '2024-05-29 13:04:56', NULL, NULL),
(1399, 19, 43, 3, 2, NULL, NULL, 'multiple', '<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ingredients<br />\r\n1 tb margarine, dairy free<br />\r\n1 tb Vegetables oil<br />\r\n1 c onion &ndash; chopped<br />\r\n8 oz Mushrooms &ndash; sliced<br />\r\n1 lg Garlic clove &ndash; minced<br />\r\n1/3 celery &ndash; thinly sliced<br />\r\n3 c Soybean milk<br />\r\n4 c Potatoes &ndash; cubed &frac12; inch<br />\r\n&frac14; ts Black pepper<br />\r\n1 ts Salt, or to taste<br />\r\n1 tb Parsley &ndash; chopped</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Directions<br />\r\n1. Saute onion, garlic, celery, and green pepper in hot oil and margarine about 3 minutes. Add sliced mushrooms and saut&eacute; 3 more minutes.<br />\r\n2. Add soybean milk, black pepper, salt and potatoes. Bring mixture almost to a boil; reduce heat and simmer 25 minutes, stirring occasionally.<br />\r\n3. Make about 6 cups. Thin with extra soybean milk if soup is too thick.<br />\r\n4. Garnish with parsley and serve with the veal.</span></span></span><br />\r\n<span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">According to the text when should we add sliced mushroom?</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">After adding soybean milk, black pepper, salt &amp; potatoes.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">After frying onions, garlic, celery &amp; green pepper.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:12pt\"><span style=\"line-height:15.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">As soon as we heat and simmer onion, garlic and green pepper.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '#####<p><span style=\"font-size:11.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Before pouring the oil and margarine.</span></span></span></p>\r\n', '#####<p>E</p>\r\n', 'B', '2024-05-29 13:06:05', NULL, NULL),
