(1469, 15, 53, 3, 2, NULL, NULL, 'multiple', '<p>Dokumen untuk mencatat transaksi penerimaan uang, di buatkan penerimaan uang, dibuatkan bukti kas masuk, sedangkan salinan faktur penjualan atau kuitansi digunakan sebagai lampiran disebut&hellip;</p>\r\n', '#####<p>Bukti kas masuk</p>\r\n', '#####<p>Bukti kas keluar</p>\r\n', '#####<p>Kas di bank</p>\r\n', '#####<p>Rekening giro</p>\r\n', '#####<p>Rekenig koran</p>\r\n', 'A', '2024-06-07 08:12:29', 11, 3),
(1470, 15, 53, 3, 2, NULL, NULL, 'multiple', '<p>Transaksi berikut yang mempengaruhi harta dan modal adalah&hellip;</p>\r\n', '#####<p>Membeli peralatan kantor secara kredit Rp.1.000.000</p>\r\n', '#####<p>Mendapatkan pinjaman uang dari bank sebesar Rp.1.000.000</p>\r\n', '#####<p>Menerima piutang dari seorang pelanggan sebesar Rp.300.000</p>\r\n', '#####<p>Membayar utang kepada seorang pelanggan Rp.100.000</p>\r\n', '#####<p>Membayar gaji karyawan Rp. 500.000</p>\r\n', 'B', '2024-06-07 07:54:26', 9, 5),
(1471, 15, 53, 3, 2, NULL, NULL, 'multiple', 'Pada tanggal 2 Agustus 2018 dilakukan pembelian peralatan sebesar Rp.5.000.000 dan baru dibayar Rp.2.000.000 sisanya akan dibayar bilan depan. Berdasarkan transaksi tersebut, maka pencatatannya dalam jurnal adalah…', '#####Peralatan (D) Rp.5.000.000 Kas (K) Rp.5.000.000', '#####Peralatan (D) Rp.2.000.000 Kas (K) Rp. 2.000.000', '#####Peralatan (D) Rp.5.000.000 utang usaha (K) Rp.5.000.000', '#####Utang usaha (D) Rp.2.000.000 Kas (K) Rp.2.000.000', '#####Peralatan (D) Rp.5.000.000 Kas (K) Rp. 2.000.000 Utang Usaha (K) Rp. 3.000.000', 'E', '2024-05-29 21:31:27', 12, 2),
(1472, 15, 53, 3, 2, NULL, NULL, 'multiple', '<p>Fungsi utama dari buku besar adalah.</p>\r\n', '#####<p>Menghitung perubahan harta, hutamg dan modal</p>\r\n', '#####<p>Pencatatan harta, utang, modal, pendapatan dan beban</p>\r\n', '#####<p>Menganalisis perubahan harta, utang, dan modal</p>\r\n', '#####<p>Mengikhtisarkan perubahan harta, utang dan modal</p>\r\n', '#####<p>Melaporkan perubahan harta, utang dan modal</p>\r\n', 'B', '2024-06-07 08:20:48', 12, 2),
(1473, 15, 53, 3, 2, NULL, NULL, 'multiple', '<p>Dibeli peralatan kantor seharga Rp.350.000, dibayar perkas Rp.150.000, sisanya kemudian. Pencatatan dalam persamaan akuntansi adalah&hellip;</p>\r\n', '#####<p>Peralatan bertambah Rp.350.000 dan kas berkurang Rp.350.000</p>\r\n', '#####<p>Peralatan bertambah Rp.350.000 dan kas berkurang 150.000</p>\r\n', '#####<p>Peralatan bertambah Rp.350.000 dan utang bertambah Rp.350.000</p>\r\n', '#####<p>Peralatan bertambah Rp.350.000 kas berkurang Rp.150.000 dan utang bertambah Rp.200.000</p>\r\n', '#####<p>Peralatan bertambah Rp.350.000 kas berkurang Rp. 200.000 dan utang bertambah Rp.150.000</p>\r\n', 'D', '2024-06-07 08:00:43', 10, 4),
(1474, 15, 53, 3, 2, NULL, NULL, 'multiple', '<p>Pernyataan yang tepat tentang mekanisme debit dan kredit pada perkiraan beban adalah&hellip;</p>\r\n', '#####<p>Didebit jika ada penambahan dan dicatat di kredit jika terjadi pengurangan</p>\r\n', '#####<p>Didebit jika terjadi pengurangan dan dicatat di kredit jika terjadi penambahan</p>\r\n', '#####<p>Dicatat pada debit baik terjadi pengurangan maupun penambahan</p>\r\n', '#####<p>Dicatat pada sisi kredit jika terjadi pengurangan maupun penambahan</p>\r\n', '#####<p>Tidak dicatat pada sisi debit maupun kredit</p>\r\n', 'A', '2024-06-07 08:14:27', 12, 2),
