(1477, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Tempat di permukaan bumi, baik secara keseluruhan maupun hanya sebagian yang digunakan oleh makhluk hidup untuk tinggal disebut', '#####Wilayah', '#####Tempat', '#####Habitat', '#####Ruang', '##### Kekuasaan', 'D', '2024-06-02 22:08:58', 14, 37),
(1478, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Secara geologis, Indonesia terletak di zona pertemuan tiga lempeng besar dunia, yaitu', '#####Eurasia, Indo-Australia, dan Pasifik', '#####Eurasia, Pasifik, dan Amerika', '#####India, Eurasia, dan Hindia', '#####Pasifik, Indo-Australia, dan Antartika', '#####. Asia, Pasifik dan Eurasia', 'A', '2024-06-02 22:08:58', 34, 17),
(1479, 26, 34, 1, 2, NULL, NULL, 'multiple', ' \nPerubahan pekerjaan dari yang tadinya berorientasi pada sumber daya alam seperti petani menjadi pekerjaan yang berorientasi pada kegiatan industri dan jasa, merupakan dampak dari interaksi antarruang dalam bidang…\n', '#####Sosial dan budaya', '#####Komposisi penduduk', '#####Penggunaan lahan', '#####Orientasi mata pencaharian', '#####Kemajuan teknologi', 'D', '2024-06-02 22:08:58', 28, 23),
(1480, 26, 34, 1, 2, NULL, NULL, 'multiple', '  Desa merupakan penghasil sumber pangan, dan kota merupakan tempat industri menghasilkan banyak barang eletronik yang jarang terdapat di desa. Untuk memenuhi kebutuhan, terjadilah interaksi antarruang. Konsep interaksi antarruang yang terjadi pada pernyataan tersebut adalah...', '#####Interaksi yang terjadi karena semua kebutuhan terjadi pada suatu ruang.', '#####Interaksi dapat terjadi karena manusia makin serakah.', '#####Interaksi dapat menjalin banyak silaturahmi.', '#####Interaksi yang terjadi karena setiap wilayah memiliki karakteristik yang terbeda.', '##### Interaksi manusia sebagai mahluk sosial', 'A', '2024-06-02 22:08:58', 15, 36),
(1481, 26, 34, 1, 2, NULL, NULL, 'multiple', '   Daerah di Indonesia Timur banyak mengalami kelangkaan air bersih karena kondisi geografis yang menyebabkan air sulit didapat. Tindakan yang dapat kamu lakukan untuk penghematan air yaitu...', '#####. Menggunakan air sebanyak mungkin karena kondisi rumah yang jauh dengan daerah kekeringan air.', '#####Menggunakan air sebjiak mungkin dengan mandi empat kali sehari.', '#####. Menggunakan air secara hemat karena kita tahu bahwa daerah lain banyak kekurangan dan harus banyak bersyukur.', '#####Menggunakan air dalam berbagai macam pemenuhan kebutuhan misalnya dengan menggunakan air untuk menyiram tanaman ketika hujan.', '#####Memanfaatkan air bekas cucian untuk menyiram tanaman', 'C', '2024-06-02 22:08:58', 42, 9),
(1482, 26, 34, 1, 2, NULL, NULL, 'multiple', '   Salah satu hal yang menyebabkan mudahnya interaksi antarruang adalah adanya transportasi dan teknologi yang semakin mudah, contohnya yaitu...', '#####. Menggunakan air sebanyak mungkin karena kondisi rumah yang jauh dengan daerah kekeringan air.', '#####Menggunakan air sebjiak mungkin dengan mandi empat kali sehari.', '#####Kemudahan untuk mendistribusikan hasil alam dengan melakukan impor dari negara lain', '#####Menggunakan air dalam berbagai macam pemenuhan kebutuhan misalnya dengan menggunakan air untuk menyiram tanaman ketika hujan.', '#####Memanfaatkan air bekas cucian untuk menyiram tanaman', 'C', '2024-06-02 22:08:58', 35, 16),
(1483, 26, 34, 1, 2, NULL, NULL, 'multiple', '   Daerah pegunungan menghasilkan bermacam-macam sayuran dan buah-buahan. Sedangkan daerah perkotaan menghasilkan banyak kebutuhan pokok yang tidak terdapat di daerah pegunungan. Interaksi ekonomi yang dapat terjadi berdasarkan pernyataan di atas adalah...', '#####. Menggunakan air sebanyak mungkin karena kondisi rumah yang jauh dengan daerah kekeringan air.', '#####Menggunakan air sebjiak mungkin dengan mandi empat kali sehari.', '#####Kemudahan untuk mendistribusikan hasil alam dengan melakukan impor dari negara lain', '#####Menggunakan air dalam berbagai macam pemenuhan kebutuhan misalnya dengan menggunakan air untuk menyiram tanaman ketika hujan.', '#####Daerah perkotaan menjual kebutuhan pokok ke daerah pegunungan, dan daerah pegunungan menjual hasil komoditasnya ke daerah perkotaan', 'E', '2024-06-02 22:08:58', 39, 12),
(1484, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Apa yang menyebabkan terjadinya keterkaitan antarruang ?', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####Suatu ruang memiliki iklim tropis diseluruh wilayah negara.', '#####Memiliki ciri khas yang berbeda-beda antara suatu ruang dengan ruang lainnya.', '#####Komposisi penduduk', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', 'C', '2024-06-02 22:08:58', 23, 28),
(1485, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Manakah dari berikut ini bukan contoh dari bentuk interaksi manusia dengan lingkungan?', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####Pembuatan bendungan untuk pembangkit listrik.', '#####Komposisi penduduk', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', '#####Kemajuan teknologi', 'C', '2024-06-02 22:08:58', 6, 45),
(1486, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Bagaimana pertumbuhan populasi dapat berkontribusi terhadap munculnya kesempatan antara?', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####Pertumbuhan populasi dapat menciptakan pasar yang lebih besar untuk produk dan jasa.', '#####Komposisi penduduk', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', '#####Kemajuan teknologi', 'B', '2024-06-02 22:08:58', 34, 17),
(1487, 26, 34, 1, 2, NULL, NULL, 'multiple', '\n. Bagaimana infrastruktur transportasi yang baik dapat berdampak pada perkembangan ekonomi suatu daerah?\n', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####Pertumbuhan populasi dapat menciptakan pasar yang lebih besar untuk produk dan jasa.', '#####. Infrastruktur transportasi yang baik dapat meningkatkan konektivitas dan perdagangan', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', '#####Kemajuan teknologi', 'C', '2024-06-02 22:08:58', 41, 10),
(1488, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Bagaimana pengembangan infrastruktur teknologi informasi dan komunikasi (TIK) dapat mempengaruhi masyarakat?', '#####Kemajuan teknologi', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####TIK hanya berdampak pada generasi muda.', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', '#####TIK dapat meningkatkan akses informasi, komunikasi, dan pembelajaran.', 'E', '2024-06-02 22:08:58', 34, 17),
(1489, 26, 34, 1, 2, NULL, NULL, 'multiple', '  Pengembangan ekonomi lokal dapat berkontribusi terhadap keberlanjutan lingkungan?', '#####Kemajuan teknologi', '#####Adanya persamaan potensi alam yang dimiliki setiap ruang.', '#####. Pengembangan ekonomi lokal dapat mendorong praktik berkelanjutan dan konservasi lingkungan.', '#####Adanya keadaan alam yang relatif sama antara satu ruang dengan ruang lainnya.', '#####Kemajuan teknologi', 'C', '2024-06-02 22:08:58', 41, 10),
