(1501, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Bank Indonesia meminta dompet digital milik asing wajib tunduk pada aturan Indonesia. Hal ini menjawab munculnya rumor dompet digital seperti Whatsapp Pay yang ingin masuk ke Indonesia.', '#####Regulator', '#####Perizinan', '##### Pengawasan', '##### Operator', '##### Fasilitator', 'A', '2024-06-02 22:08:58', 12, 39),
