(1504, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Sejak krisis melanda, Indonesia sudah berbenah. Setidaknya ada empat reformasi struktural yang telah dan sedang dilakukan sehingga bisa bertahan di tengah perlambatan pertumbuhan ekonomi dunia. Pertama, pasca krisis ekonomi 1998, Indonesia menjalankan kebijakan baik fiskal maupun moneter yang mengedepankan macroprudential.', '#####Menetapkan dan menjalankan kebijakan moneter', '#####Untuk menyejahterakan masyarakat', '#####Untuk menambah beban hutang pada masyarakat', '#####Untuk membantu nasabah belajar menabung', '#####Untuk memberi kesempatan masyarakat memulai produksi', 'A', '2024-06-02 22:08:58', 30, 21),
(1505, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Uang bernilai penuh (full bodied money) adalah...', '#####Untuk membuat uang Rp 15.000,00 dibutuhkan biaya Rp 5.000,00', '#####Untuk membuat uang Rp 15.000,00 dibutuhkan biaya Rp 15.000,00', '#####', '#####Untuk membuat uang Rp 15.000,00 dibutuhkan biaya Rp 1.000,00', '#####Untuk membuat uang Rp 15.000,00 dibutuhkan biaya Rp 2.000,00', 'B', '2024-06-02 22:08:58', 26, 25),
(1506, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Uang yang berbentuk saldo rekening di bank milik nasabah, yang dapat digunakan sebagai alat pembayaran. Cara pembayaran dengan menggunakan cek, giro, telegraphic transfer, travel chek (cek dengan perjanjian). Jenis uang yang dimaksud adalah:\n\n', '#####Uang kartal', '#####. Uang giral', '#####Uang kertas', '#####Uang Digital', '#####Uang  Logam', 'B', '2024-06-02 22:08:58', 13, 38),
(1507, 26, 34, 1, 2, NULL, NULL, 'multiple', '   Konvensional yang dalam kegiatannya memberikan jasa lalu lintas pembayaran. BCA termasuk jenis:', '#####Koperasi', '#####BTM', '#####Milik pemerintah, bank syariah milik yayasan', '#####. Bank sentral', '#####. Bank umum', 'E', '2024-06-02 22:08:58', 27, 24),
(1508, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Bank Amanah Tambun adalah sebuah bank perkreditan rakyat yang tidak boleh memiliki kegiatan:', '#####Memberikan kredit kepada masyarakat sekitar', '#####Menempatkan dananya dalam bentuk SBI', '#####Memberikan kredit kepada masyarakat sekitar', '#####Melakukan kegiatan usaha dalam valuta asing', '#####Untuk memberi kesempatan masyarakat memulai produksi', 'D', '2024-06-02 22:08:58', 26, 25),
(1509, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Jumlah masyarakat yang menggadaikan barang ke pegadaian meningkat. Peningkatan ini diduga karena kebutuhan mendekati Idul Fitri, serta ekonomi yang sulit akibat pandemi corona.', '#####Membina perekonomian rakyat kecil dengan menyalurkan kredit atas dasar hukum gadai', '#####Ikut serta mencegah adanya pemberian pinjaman yang tidak wajar, ijon, pegadaian gelap dan praktik riba lainnya', '#####Menyalurkan kredit maupun usaha-usaha lainnya yang bermanfaat terutama', '#####Membina pola perkreditan supaya benar-benar terarah dan bermanfaat', '##### Fasilitator', 'B', '2024-06-02 22:08:58', 14, 37),
(1510, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Perusahaan Humida adalah melakukan pembiayaan kepada perusahaan kecil yang belum memiliki bentuk badan hukum perseroan terbatas. Usaha yang dilakukannya termasuk dalam:', '#####Modal ventura', '#####Menempatkan dananya dalam bentuk SBI', '#####Memberikan kredit kepada masyarakat sekitar', '#####Melakukan kegiatan usaha dalam valuta asing', '#####Untuk memberi kesempatan masyarakat memulai produksi', 'A', '2024-06-02 22:08:58', 10, 41),
(1511, 26, 34, 1, 2, NULL, NULL, 'multiple', '  Tugas Bank Indonesia yang kini dilakukan oleh Otoritas Jasa Keuangan (OJK) adalah:', '#####Pengawasan', '##### Operator', '#####Mengatur dan mengawasi bank', '#####Perizinan', '#####Pengawasan', 'C', '2024-06-02 22:08:58', 41, 10),
(1512, 26, 34, 1, 2, NULL, NULL, 'multiple', '  Tujuan dibentuknya OJK:', '#####keseluruhan kegiatan di sector jasa keuangan terselenggara secara teratur', '#####Agar seluruh kegiatan di sector jasa keuangan mampu mewujudkan sector keuangan yang stabil', '#####Agar seluruh kegiatan di sector keuangan mampu melindungi kepentingan konsumen dan masyarakat', '#####Agar seluruh kegiatan di sector jasa keuangan mampu mewujudkan sector keuangan yang transparan dan akuntabel.', '#####smua benar', 'E', '2024-06-02 22:08:58', 18, 33),
(1513, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Bu Ratna membeli motor Honda di Dealer Honda Motor Abadi Tambun. Pembelian dilakukan secara angsuran namun setelah kontrak ditandatangani, segala fasilitas dan kegunaan motor sudah bisa dinikmati Bu Ratna. Motor Bu Ratna sudah dibayar oleh Adira secara tunai, sehingga Bu Ratna membayar angsurannya ke Adira Finance.', '#####Modal ventura', '#####Perusahaan sewa guna/leasing', '#####Koperasi', '#####Asuransi', '#####Bursa efek', 'B', '2024-06-02 22:08:58', 10, 41),
(1514, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Produk perbankan yang paling memungkinkan dilakukan siswa adalah...', '#####Modal ventura', '#####Perusahaan sewa guna/leasing', '#####Koperasi', '#####Asuransi', '#####Tabungan', 'E', '2024-06-02 22:08:58', 43, 8),
(1515, 26, 34, 1, 2, NULL, NULL, 'multiple', '     Bank campuran adalah bank yang sebagian modalnya dimiliki pemerintah dan sebagian lainnya dimiliki swasta adalah:', '#####BTM', '#####Milik pemerintah, bank syariah milik yayasan', '#####. Bank sentral', '#####. Bank umum', '#####. Bank ANZ Indonesia', 'E', '2024-06-02 22:08:58', 14, 37),
(1516, 26, 34, 1, 2, NULL, NULL, 'multiple', '\nJika Tuan Hendri dan Bank Syariah Mandiri menjalin kerja sama pembiayaan berdasarkan prinsip penyertaan modal di mana Bank Syariah Mandiri menjadi mitra Tuan Hendri dan kedua pihak saling memberikan modal. Prinsip ini dinamakan...\n', '#####. Prinsip musyarakah', '#####Modal ventura', '#####Perusahaan sewa guna/leasing', '#####Koperasi', '#####Asuransi', 'A', '2024-06-02 22:08:58', 24, 27),
(1517, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Keinginan merencanakan pengorganisasian serta mengendalikan keuangan untuk kegiatan konsumsi, tabungan maupun investasi merupakan definisi dari ….', '#####Managemen keuangan', '#####Pengelolaan keuangan', '#####Literasi keuangan', '#####Skala Prioritas', '#####Koperasi', 'B', '2024-06-02 22:08:58', 25, 26),
(1518, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Fungsi utama dari rencana keuangan pribadi adalah …', '#####Mengetahui keuangan pribadi', '#####Meningkatan pendapatan dan mengurangi pengeluaran', '#####Menghambat pertumbuhan ekonomi', '#####Skala Prioritas', '#####Mengelola pengeluaran dan pendapatan', 'B', '2024-06-02 22:08:58', 12, 39),
(1519, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Sebagai pelajar, apa yang bisa kalian lakukan agar lebih hemat dalam pengeluaran sehari-hari?', '#####Membuat daftar belanjaan dan membatasi pengeluaran sesuai daftar', '#####Membawa tumbler saat bepergian', '#####Sarapan sebelum berangkat sekolah', '#####Membeli BBM di POM Bensin', '#####Membawa bekal saat berangkat sekolah', 'A', '2024-06-02 22:08:58', 18, 33),
(1520, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Sebagai pelajar, apa yang bisa kalian lakukan agar pengeluaran tidak melebihi pendapatan?\n', '#####Mengelola pengeluaran dengan bijak', '#####Meningkatan pendapatan dan mengurangi pengeluaran', '#####Menghambat pertumbuhan ekonomi', '#####Skala Prioritas', '#####Mengelola pengeluaran dan pendapatan', 'A', '2024-06-02 22:08:58', 30, 21),
(1521, 26, 34, 1, 2, NULL, NULL, 'multiple', 'ga Berikut ini merupakan hal-hal yang bisa dilakukan untuk mengelola uang saku dengan bijak….', '#####Mengetahui keuangan pribadi', '#####Meningkatan pendapatan dan mengurangi pengeluaran', '#####Menabung sejumlah kecil uang setiap hari', '#####Membeli BBM di POM Bensin', '#####Membawa bekal saat berangkat sekolah', 'C', '2024-06-02 22:08:58', 27, 24),
(1522, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Dalam Menyusun daftar pengeluaran perlu diperhatikan beberapa hal sebagai berikut, kecuali ….', '#####Mengelola pengeluaran dengan bijak', '#####Membeli barang-barang mewah untuk branding', '#####Menghambat pertumbuhan ekonomi', '#####Skala Prioritas', '#####Mengelola pengeluaran dan pendapatan', 'B', '2024-06-02 22:08:58', 32, 19),
(1523, 26, 34, 1, 2, NULL, NULL, 'multiple', 'Agar pendapatan dapat dipergunakan untuk memenuhi kebutuhan maka hal-hal yang bisa kita lakukan adalah …..\n', '#####Memenuhi setiap keinginan', '#####Memenuhi setiap kebutuhan', '#####Menghambat pertumbuhan ekonomi', '#####Skala Prioritas', '#####Mengelola pengeluaran dan pendapatan', 'B', '2024-06-02 22:08:58', 13, 38),
(1524, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Dalam mengelola keuangan, terdapat langkah-langkah yang bisa kita lakukan mulai dari tahap pertama yaitu ….', '#####Membuat perencanaan atau anggaran', '#####Membuat rincian pengeluaran', '#####Membuat daftar barang yang dibutuhkan', '#####Membuat rincian pendapatan', '#####Membuat daftar pendapatan dan pengeluaran', 'A', '2024-06-02 22:08:58', 18, 33),
(1525, 26, 34, 1, 2, NULL, NULL, 'multiple', ' Pencatatn sederhana pendapatan dan pengeluaran yang didapatkan selama satu bulan merupakan karakteristik dari sistem pengelolaan keuangan ……', '#####Sistem amplop', '#####Sistem kas keluarga', '#####Sistem buku kas harian', '#####Sistem tabungan', '#####Sistem tabungan', 'D', '2024-06-02 22:08:58', 12, 39),
(1526, 26, 34, 1, 2, NULL, NULL, 'multiple', '<p>Apa yang dimaksud dengan konservasi?</p>\r\n', '#####<p>Upaya pelestarian sumber daya alam</p>\r\n', '#####<p>Upaya penghancuran sumber daya alam</p>\r\n', '#####<p>Upaya pemanfaatan sumber daya alam</p>\r\n', '#####<p>Upaya penelitian sumber daya alam</p>\r\n', '#####<p>Energi yang dapat diperbaharui</p>\r\n', 'A', '2024-06-02 22:25:14', NULL, NULL);
